INSERT INTO `post` VALUES(124, 'Omotola Jalades Embarassing Dress at The Grammys 2011\r\n\r\nOmotola Jalade was the first Nollywood actress to walk The Grammy 2011 Red Carpet and it was all good news till pictures started coming in. The red carpet appearance was made possible by her international mangement\r\n  Bishop Entertainment consult and Bungalo/Universal Records. How we wish pictures didnt come!!\r\n\r\nBTW, #DeadCurious: where are the red carpet pictures with Tiwa Savage in them?\r\n\r\nAlso, what could one of Omotolas international managers palm be doing so close to her bum (as seen in the picture below)  he could have almost grabbed her bum. Playa, your arm should be on her lower back, make sure captain  thats her husband for those of you who dont know  catch you.', 47, 52, '2012-08-30 10:47:46', 'Show');
