INSERT INTO `post` VALUES(126, 'August 30, 2012  Fraudsters Impersonate Pastor Adeboye On Facebook\r\n\r\n\r\nRedeemed Christian Church of God General Overseer, Pastor Enoch Adejare Adeboye raised a warning message on his Facebook Page yesterday to friends and followers that fraudsters who have devised means  of extorting money from unsuspecting members of his church have started creating different Facebook accounts in his name.\r\nDaddy GO warned members of the public to verify the authenticity of any page claiming to be his before yielding to any instructions.\r\n\r\nHere is what the man of God said:\r\n\r\nPlease be very careful what you easily fall for. There are some persons going around creating false Facebook pages or names, claiming they are Pastor E. A. Adeboye.\r\n\r\nAll you have to do is a search for them on Facebook and they will add you and then pretend to be me, telling you to send some money into an account and because they know you will obey me, they are using this as a new form of fraud. Please stop them and report those pages to Facebook so they can be stopped.\r\n\r\nA member of his church reported a page on Facebook asking people to contribute money that he wants to embark on a trip to India.\r\n\r\nPastor Adeboyes comment has gone viral over the net as several folks had replied by cursing those behind such acts. some had stated that no true christain will fall victim since the spirit will always direct them. According to some people, a true christian will always work in the spirit.\r\nHowever, the post that generated a lot of argument saw different people taking on each other as a result of difference in opinion.\r\n\r\nBe warned people.', 30, 52, '2012-08-30 10:55:03', 'Show');
INSERT INTO `post` VALUES(127, 'The former President of Ghana, Jerry John Rawlings, has admonished President Mahama to restore dignity and integrity to the Presidency, which he says would be his first step to victory in the 2012 elections.\r\n\r\nAddressing a charged crowd at the Baba Yara Sports Stadium on Thursday, ex President Rawlings said electoral victory will depend on a number of things such as how quickly you can restore integrity to the presidency, to the government and to the party.\r\n\r\nPresident Rawlings also urged members of the NDC to desist from the habit of poking insults to people who have sacrificed for the party and attempting to embrace them during elections just for political expediency.\r\n\r\nThe uncivilized tendency of poking people who have sacrificed and later attempting to embrace them for political expediency must stop. Its an insult to their intelligence.\r\n\r\nHow much of the damage can we correct in order to enhance our prospect? How much credibility can we restore now before the elections? Mr. Rawlings queried.\r\n\r\nHe however expressed his gratitude to the President Mahama for his quick response to providing street lights to Tefle, an area in the Volta region where a spate of women have murdered in recent times.\r\n\r\nI would like you all to join me in congratulating the President John Mahama, he responded to an urgent request to use his authority to provide streetlights where a spate of killings has increased drastically over the last year. He very quickly ordered the ECG people to get the place lit up the place.\r\n\r\nWhile I am grateful and expressing this gratitude for his intervention, it is important that the lukewarm attitude of some of these incidents should be investigated President Rawlings said.\r\n\r\nThe founder of the NDC also made a clarion call to all members of the party to move put and begin vigorous campaign to ensure that the NDC retains power.\r\n\r\nThose sitting at the comfort of their homes, waiting for others to win elections for them the time has come for them to wake up and hit the campaign trail. Use this gathering, hopefully, to bring back the principles that have established us from other political parties.', 30, 52, '2012-08-30 11:01:03', 'Show');
INSERT INTO `post` VALUES(128, '<span class="notBold">Gossout</span><div class="post">\r\n                <img class="profile_small"src="upload/thumbnails/1345894377_52_1789_50x50.jpeg"/>\r\n                <p class="name"><a href="page.php?view=profile&uid=52">Ugbabe Ediga</a></p><p class="status">The former President of Ghana, Jerry John Rawlings, has admonished President Mahama to restore dignity and integrity to the Presidency, which he says would be his first step to victory in the 2012 elections.\r\n\r\nAddressing a charged crowd at the Baba Yara Sports Stadium on Thursday, ex President Rawlings said electoral victory will depend on a number of things such as how quickly you can restore integrity to the presidency, to the government and to the party.\r\n\r\nPresident Rawlings also urged members of the NDC to desist from the habit of poking insults to people who have sacrificed for the party and attempting to embrace them during elections just for political expediency.\r\n\r\nThe uncivilized tendency of poking people who have sacrificed and later attempting to embrace them for political expediency must stop. Its an insult to their intelligence.\r\n\r\nHow much of the damage can we correct in order to enhance our prospect? How much credibility can we restore now before the elections? Mr. Rawlings queried.\r\n\r\nHe however expressed his gratitude to the President Mahama for his quick response to providing street lights to Tefle, an area in the Volta region where a spate of women have murdered in recent times.\r\n\r\nI would like you all to join me in congratulating the President John Mahama, he responded to an urgent request to use his authority to provide streetlights where a spate of killings has increased drastically over the last year. He very quickly ordered the ECG people to get the place lit up the place.\r\n\r\nWhile I am grateful and expressing this gratitude for his intervention, it is important that the lukewarm attitude of some of these incidents should be investigated President Rawlings said.\r\n\r\nThe founder of the NDC also made a clarion call to all members of the party to move put and begin vigorous campaign to ensure that the NDC retains power.\r\n\r\nThose sitting at the comfort of their homes, waiting for others to win elections for them the time has come for them to wake up and hit the campaign trail. Use this gathering, hopefully, to bring back the principles that have established us from other political parties.</p><ul class="box"><li><img src="upload/community_pix/1346349643_52__250x250.jpeg"/></li></ul><div class="post_activities"><span><a href="page.php?view=community&com=30">in Ahmadu Bello University, Zaria, Nigeria</a></span></div></div>', 30, 49, '2012-08-30 14:00:05', 'Show');
