INSERT INTO `post` VALUES(134, 'who says we are free? i''am not talking about you and me but we,check this video and mention your views here and feel free to share with world.\n\nhttp://www.ted.com/talks/lang/en/lisa_kristine_glimpses_of_modern_day_slavery.html\n\nTED Talks For the past two years, photographer Lisa Kristine has traveled the world, documenting the unbearably harsh realities of modern-day slavery. She shares hauntingly beautiful images -- miners in the Congo, brick layers in Nepal -- illuminating the plight of the 27 million souls enslaved world wide.', 30, 184, '2012-08-30 22:17:10', 'Show');
