INSERT INTO `post` VALUES(136, 'Gentlesoul wrote:\n\nTAKE NOTE.....\nIf you are SINGLE and keep on saying&quot;I DON''T TRUST MEN OR WOMEN!&quot; remember... your mates are getting married every Saturday. Let me ask you, are they marrying spirits? Wise up! \n\nIf you are MARRIED and keep saying &quot;I HATE THIS MARRIAGE!&quot; OK! Is it not married people like you that are celebrating Gold, Silver and even Platinum jubilee? If you keep on ranting, ''''I''M LEAVING MY MAN, HE CHEATED ON ME!&quot; Please, go to town and see all the fine, cute, hot, hungry and desperate chicks waiting to snatch your man''s money and property, they don''t even mind sharing. Make it work, \n\nmy friend! Stop saying &quot;I HATE MY JOB!&quot; Look! 20 million people are jobless and can''t even find any not\nto talk of keeping it! Do you want to join them? \n\nYou keep saying &quot;I HATE WHERE I LIVE!&quot; Oh please! *tears* Try visiting those locations that are flooded now, people leaving in tin/zinc shacks in winter or people living/ sleeping under the bridge at night and you will be grateful to God that you even have a place to stay! \n\nSome say &quot;I AM TIRED OF THIS LIFE!&quot; Well, go to the hospital and see people fighting for their lives! Go to the mortuary and take a look then tell me what you feel after that!.....Mypoint is, be positive, THERE IS ALWAYS A REASON TO GIVE THANKS T God Almighty......Peace.Barka Da Jumma''ah', 30, 184, '2012-08-31 04:31:23', 'Show');
