INSERT INTO `post` VALUES(200, 'A man went to a barber shop to have his beard and hair cut as always. He started to have a good conversation with the barber who attended him. They talked about so many things and various subjects. Suddenly, they touched the subject God. The barber said, Look man, I dont believe that God exist as you say so.\nWhy do you say that? asked the client. Well it`s so easy, you just have to go out in the street to realize that God not exist. Tell me ,if God exists, would they be so many sick people? Would there be abandoned children? If God exists ,they would be no suffering nor pain. I cant think of a God who permits all of these things, screamed the barber.\nThe client stopped for a moment thinking but he did not want to respond so as to prevent an argument. The barber finished his job and the client went out of the shop.\nAs the client was now walking in the street from the barber shop , he saw a man walkingin the pavement with a very long hair and beard(it seems that it had been a long time since he had his hair cut and he looked so untidy)\nThe client again entered the barber shop and said to the barber:\nYou know what? Barbers do not exist!\nHow come they dont exist? said the barber.well, I am here and I am a barber.\nNo! the client exclaimed. The dont exist because if they did they would be no people with long hair and beards like the man who walks in the street\nAh, barbers do exist, what happens is that people do not come to us.\nExactly! affirmed the client. Thats the point. God does exist, what happens is peopledont go to Him and do not look for HIM and that is why there is so much pain and suffering in the world!! Morning peeps.', 66, 184, '2012-09-10 02:01:47', 'Show');
