INSERT INTO `post` VALUES(409, 'VACANCY! VACANCY!! VACANCY!!!\nIFAKO INTERNATIONAL SCHOOLS VACANCIES\nIFAKO INTERNATIONAL SCHOOLS\n99/101 IJU ROAD, IFAKO-IJAIYE, LAGOS.\nSTAFF VACANCIES\nAPPLICATIONS ARE INVITED FROM SUITABLY QUALIFIED CANDIDATES TO FILL THE VACAMCIES IN THE POSITIONS LISTED BELOW.\nTUTORS\n MATHEMATICS\n ENGLISH LANGUAGE\n YORUBA\nQUALIFICATION AND EXPERIENCE\n A GOOD UNIVERSITY DEGREE IN EDUCATION, WITH AT LEAST THREE YEARS EXPERIENCE ON THE JOB AND MUST NOT BE LESS THAN 35 YEARS OLD\nRESIDENT NURSE\nQUALIFICATION AND EXPERIENCE\n REGISTERED NURSE WITH AT LEAST 3 YEARS EXPERIENCE\nHOW TO APPLY\nAPPLICATIONS SHOULD BE SENT ON LINE TO: ifakoint@aol.com WITHIN ONE WEEK OF THIS PUBLICATION OR DELIVERED BY HAND IN THE SCHOOL.', 80, 265, '2012-10-14 13:28:16', 'Show');
INSERT INTO `post` VALUES(410, 'REGGIE BUSH''S GIRLFRIEND IS PREGNANT\n\nKim Ks ex and partner are now officially in the family way.\n\n\nFootball is only his career but Reggie Bushs next most important job will be daddy.\n\nThe Miami Dolphins star confirmed Tuesday on Floridas Paul and Young Ron Morning Show that he and girlfriend Lilit Avagyan are expecting their first child together.\n\nBush, who dated Kim Kardashian off and on from 2007 to 2010, is extremely happy by the news.\n\nI have a little one on the way he told the Paul and Young Ron Morning Show. Were pretty excited. We havent found out if its a boy or girl yet.\n\nBush also seems to be anxiously anticipating his new role as family man. We cant wait. Its the opportunity to bring in a new life and raise a child. I think thats the most special gift to a man and to a woman, says Bush. So I look forward to it and to building a family.\n\nBut like most men whove dated actively in a lifetime, hes looking forward to having a mini version of himself when the baby arrives. Im hoping for a boy, says Bush. Because if its a girl, Im going straight to the gun shop to buy some guns.\n\n \n\nCongrats to the expectant couple!', 80, 265, '2012-10-14 13:35:55', 'Show');
