INSERT INTO `post` VALUES(415, 'One half of P-Square music group, Peter Okoye has now worn a new look. The father of one and an expectant father with a second child from babymama, Lola Omotayo posted some of the pictures online.\r\n\r\nThe publicity freak singer changed from his low-cut hairstyle to a ''Gallas'' style of haircut. Peter has for some time now, not gone for braids or dreadlocks hairstyle like his twin brother.\r\n\r\nMeanwhile, the duo stormed Zimbabwe for the much publicized concert in the African country. Peter was pictured being mobbed by some of his happy fans in that country.', 30, 61, '2012-10-14 22:50:09', 'Show');
INSERT INTO `post` VALUES(416, 'Cossy Orjiakor is a household name. For an average Nigerian, she is the b*obs'' flaunting lady and to some elite, she is the highly intelligent actress, dancer cum singer who holds a master degree. But for whatever reason she is called, she is simply a woman with a good heart.\r\nCossy has disclosed one of the draw backs of being a celebrated actress in Nigeria. She recounts how some just grabbed her b*obs while stuck in traffic.\r\n\r\nHear her, ', 80, 265, '2012-10-14 22:55:26', 'Show');
