INSERT INTO `post` VALUES(418, 'Despite her status as super artiste under the Marvin Records, Tiwa Savage whose brother, Sola, runs an automobile engineering coy called, parts4car, was recently caught off guard pounding yam\r\n\r\nThe Kelekele crooner, Tiwa Savage is not just natural in nature but every man''s delight and she is sure going to be a good housewife any day with her culinary ability.\r\n\r\nFor different reasons, she has people that love her. Some love her because of her talent, some for her looks, others for her down to earth nature which she displays anywhere without giving a hoot about her status.', 80, 265, '2012-10-14 22:59:23', 'Show');
INSERT INTO `post` VALUES(419, 'Chief Keef has had a powerful ally in 50 Cent, and now the two have officially joined forces on wax. The G-Unit general broke the news on Twitter last night that he and Keef recently recorded a song together.\r\n\r\nI did a new joint tonight with @chiefkeef, he wrote. He got some heat.\r\n\r\nPreviously, 50 had come to the defense of Keef after the 20-year-old rapper from Chicago came under fire for being perceived as promoting violence in his own neighborhoods. The ', 80, 265, '2012-10-15 03:38:09', 'Show');
INSERT INTO `post` VALUES(420, 'After a brief scare over the summer, Game''s wedding to Tiffney Cambridge is back on... and so are the cameras. Marrying the Game, a reality show that will follow the gangster rapper''s wedding to his school-teacher fiance is set to hit airwaves November 19.\r\n\r\nGame and Cambridge have been dating off and on for eight years and have two children together, King, 5, and Cali Dream, 1. In July, Game said that Tiffney had called off the wedding, but later it was reported to be back on.\r\n\r\nThe series will follow the couple''s trials and tribulations as they prepare to head down the aisle. The series begins November 19.', 80, 265, '2012-10-15 03:40:08', 'Show');
INSERT INTO `post` VALUES(421, 'The CEO of G.O.O.D Music won seven awards out of 17 which he was nominated for including Producer of the Year and Track of the Year shared with rap partner Jay Z.\r\n\r\nAnother big winner of the night was Def Jam rapper 2 Chainz who walked away with three awards including the Rookie of the Year, beating MMG rapper Meek Mill.\r\n\r\nJay Z and Rick Ross also won the Hustler of the Year and MVP of the Year respectively.\r\n\r\nNas Jones won his first ever BET Hip-Hop award for his single Daughters in the Impact Track category.', 80, 265, '2012-10-15 03:52:53', 'Show');
INSERT INTO `post` VALUES(422, 'The Rookie competition was set by The Headies to give one talented upcoming act, a once in a lifetime opportunity to perform on the big stage.\r\n\r\nIn the past weeks, members of the public have voted talented upcomers to meet the eligibility criteria of the Headies Rookie Competition.\r\n\r\nThe top 5 artistes were Slim T, Yung L, Saeon, Burna Boy and Dammy Krane.\r\n\r\nSlim T came 5th, Yung L 4th, Saeon 3rd and he will be performing at the Nominees Parties in Lagos on October 13th &amp; Abuja on October 19th.\r\n\r\nWhile Burna Boy and Dammy Krane have a strong tie for the 1st position and will be performing at the Headies 2012 come October 20th.', 80, 265, '2012-10-15 03:55:50', 'Show');
INSERT INTO `post` VALUES(423, 'A secondary school teacher, Mrs. Gloria Ayogu, on Sunday said she would consider legal actions against Nollywood actor, Nkem Owoh, popularly known as Osuofia, if he failed to pay damages for allegedly demolishing her house in Enugu State.\r\n\r\nAyogu, a widow and an employee of Federal Government College, Enugu, has since 2008 been at war with Owoh over a piece of land at 9, Ikpeama Street, Emeheluaku Layout, Trans-Ekulu in Enugu metropolis.\r\n\r\nThe widow said she had long reported the case to the police and vowed to see the matter to the end.\r\n\r\nShe said her late husband bought and registered the landed property before he died in 2004.\r\n\r\nShe claimed, Osuofia and his thugs appeared in 2008 and threatened me for four years against', 80, 265, '2012-10-15 05:05:54', 'Show');
INSERT INTO `post` VALUES(424, 'The parents of Lucy Ukpong who was reportedly shot dead by policemen in Abuja on Friday will on Monday (today) visit the Federal Capital Territory Police Command to demand justice for the killing of their daughter.\r\n\r\nThe Ukpongs,  who reside in Akwa-Ibom State, were scheduled to arrive in Abuja on Sunday to meet with their relations in the city before visiting the police.\r\n\r\nOur correspondent learnt that the couple would demand to know what the police authorities were doing to bring their daughters killers to book.', 80, 265, '2012-10-15 05:07:12', 'Show');
