INSERT INTO `post` VALUES(430, 'Former ABU Dean Of Law Embezzled N16m, Handed-over 400,000 To Successor, Lecturers Petition EFCC\r\nSome lecturers of Ahmadu Bello University (ABU) Zaria, under the auspices of the Coalition for Transparency, have petitioned the Minister of Education and the Economic and Financial Crimes Commission (EFCC), claiming that a former Dean of the institutions Faculty of Law, Professor Nuhu Mohammed Jamo, embezzled 16 million Naira, which was donated by the alumni of the faculty. \r\n\r\nProfessor Jamo, who served in the position between 2010 and 2012, allegedly handed over only 400, 000 to his successor.', 80, 265, '2012-10-15 09:14:54', 'Show');
INSERT INTO `post` VALUES(431, 'According to incoming reports, another massive explosion has occurred in Maiduguri, the capital of Borno State. The incident, according to eye witnesses who counted at least 10 corpses, took place at the Post Office area earlier today.\r\n\r\nHowever, another bomb explosion, was averted this morning in Minna, Niger State, thanks to the quick intervention of the anti bomb disposal unit of the Police Force.\r\n\r\nThe Improvised Explosive Device (IED), was discovered in a polythene bag, placed by the road side opposite the Abdulsalami Motor Park. A passerby alerted the security personnel, who arrived and defused it.', 80, 265, '2012-10-15 09:18:43', 'Show');
