INSERT INTO `post` VALUES(435, 'Registrar and Chief Executive of Joint Admissions and Matriculation Board, Prof. Dibu Ojerinde, has said that the board will introduce Computer-Based-Testing for candidates in its matriculation examination in 2013.\r\n\r\nHe stated that the innovation would commence on a transitional scale, accommodating between 150,000 and 250,000 candidates in the first experiment in 2013.\r\n\r\nHe spoke during the inauguration of the boards new zonal office in Ilorin, Kwara State, last Tuesday.\r\n\r\nOjerinde said the board was hopeful of converting the Computer-Based Testing for all candidates in 2015.', 80, 265, '2012-10-15 22:31:14', 'Show');
INSERT INTO `post` VALUES(436, 'Residents of Papa Olorunda Victorious Community in Obafemi Owode Local Government Area of Ogun State have raised the alarm over incessant robbery attacks.\r\n\r\nThis is just as a 15-year-old girl was raped and beaten up by a hoodlum in the area in broad daylight last Thursday.\r\n\r\nWe learnt that the hoodlums usually operate in groups and move around on motorcycles.', 80, 265, '2012-10-15 22:37:08', 'Show');
INSERT INTO `post` VALUES(437, 'Armed robbers in some parts of Lagos State now disguise as beggars to rob their victims of valuables.\r\n\r\nWe learnt that they usually pretend to be beggars and target mostly lone occupants of posh cars and dispossess them of their valuable items such as laptops, phones and money.\r\n\r\nThe hoodlums, it was gathered, always arm themselves with dangerous weapons such as knives and shotguns (stuck in their dresses).\r\n\r\nThe criminals, who usually start their operations between 5pm and 9pm, always capitalise on gridlock.\r\n\r\nIt was also learnt that some of them had perfected the art of developing a deformity to deceive their prey and in the process rob them.\r\n\r\nAreas where their activities are predominant in the metropolis are Mile Two Bridge; Coconut and Apapa, all on Oshodi-Apapa Expressway.', 80, 265, '2012-10-15 22:39:11', 'Show');
INSERT INTO `post` VALUES(438, 'Cristiano Ronaldo is expected to win his 100th international cap in a World Cup qualifier against Northern Ireland in Porto on Tuesday.\r\n\r\nThe 27-year-old Real Madrid forward has overcome a shoulder injury in time for the Group F tie at Dragao Stadium.\r\n\r\nRonaldo is already highly decorated, having won the Ballon dOr and Fifa World Player of the Year, both in 2008.\r\n\r\nReaching a centenary of caps in front of 50,000 fans will signify yet another accolade for Portugals number seven.\r\n\r\nShould he make an appearance on Tuesday, Ronaldo will become the second-youngest European of all time to play 100 games for his country, after Germanys Lukas Podolski.', 80, 265, '2012-10-15 22:43:43', 'Show');
