INSERT INTO `post` VALUES(442, 'What woman does not like to hear something nice about herself! But there are several times when a guy might think twice before paying compliments to a woman for fear of sounding insincere, patronizing or even downright offensive. Here are a few ideas on the best compliments to pay which are sure to melt any womans heart and give you that extra edge over other men.\r\n\r\nGet relationship advice, join the Futurescopes forum!\r\n\r\nWow, that looks good on you.\r\nThe secret in paying the perfect compliment to a woman is to be specific. You may not be a guy who is a keen follower of the fashion trends of the season, but when saying something nice about a womans personal style, try to pinpoint what you are appreciating. Instead of saying something general like You look gorgeous, try to highlight a specific aspect of her style and then compliment her on it. If she has turned up in smashing evening gown for a special date, you could say something like Wow this shade of maroon really brings out the color of your eyes.  Or zero in on an accessory she is wearing and say something nice about it, like That is a very attractive looking pendant you are wearing.\r\n\r\nTIP: Ask the right questions and imply a compliment - that works better than giving a direct compliment. Read ''Tell Me Honey...2000 Questions for Couples'' , the bestselling book from Amazon, also available as an instant download ebook.\r\n \r\n\r\nYou smell like heaven.\r\nThis is a perfect way of telling a woman that she is sensual without implying anything offensive. Perfume is a virtually essential part of a womans grooming and almost all women invest a lot of time and thought in settling for that perfect fragrance which will highlight their personality and moods. So paying a compliment to a womans fragrance is not only an appreciation of her sensuality and her feminine attractiveness but also to her discriminating choice in perfumes.\r\n \r\n\r\nI wish Id met you sooner.\r\nThis can be one of the most romantic compliments a guy can pay a woman. The thought that she makes such an incredible difference in a mans life that he would want to know her for a longer period of time can be very satisfying to a woman. Here the trick is to slip in the compliment casually as part of a conversation. Better still, use the compliment to answer a question in a what if game. For instance when your partner asks you if you could change one thing in your life, what would it be, say I wish I had met you sooner, and she will be sure to remember your reply for a long, long time to come.\r\n \r\n\r\nNice wheels.\r\nCompliments to a woman need not be related only to her appearance or your relationship. It could also be some other aspect of her life which she is proud of but not feminine in the conventional sense. For instance if she offers to drive you home after your third or fourth date, pass an appreciative glance over her car and say something like nice wheels. She is sure to feel thrilled by your compliment and warmed by the fact that you have noticed her choice and care of a vehicle - something that is generally seen as a guy thing.\r\n \r\n\r\nYou do this so well.\r\nOne of the safest ways to compliment a woman is to point out how nicely different she is from others. Here you could highlight a special attribute or quality that your date/partner possesses. For instance if she is interested in baking, point out how her pastries are the lightest you have ever tasted. Of if she is great with numbers, compliment on her mental agility which you have never come across in anyone else. The thing is to make a woman feel way above the ordinary - special not only to you but compared to others as well.\r\n \r\n\r\nYou make me a better person.\r\nIf said in the right way, this phrase can rouse a whole world of emotions in a woman. This is because almost all women, consciously or unconsciously, dream of making a significant and positive difference to a mans personality and existence. A woman would be pleased to know that without appearing to mother a guy she has somehow added more value to his life. The only thing to remember here is that you should find a quiet and sober moment to say this so that she believes that you actually mean what you are saying.\r\n \r\n\r\nYoure the smartest girl I ever dated.\r\nThis conveys to a woman that you consider her being much more than a pretty smile or a hot body, that you recognize something deeper and more substantial in her than the sum of her physical attributes. Being appreciated for ones intelligence or personality can be very empowering to a woman and if your compliment gives a boost to her self-esteem, she is sure to carry a favorable impression of you.\r\n \r\n\r\nNotice what is different.\r\nThe best way to know what to compliment a woman about is to observe her. See how she looks, talks or feels different than from previous days and you will get a clue on what to say to her. See if she has got a new hairstyle or changed the color of her contact lenses. Pick out something that is new or unusual and then say something nice about it. For instance if she has a silk scarf on, dont just stop at how nice she looks with it but also go on to point out how exquisite the weaving of the scarf is. She will be flattered to know that not only you have taken the pains to observe an unusual accessory that she is wearing but have recognized her discriminating taste in fabrics.\r\n \r\n\r\nCompliment her personality\r\nYet another pleasant thing to hear from a man would be about the womans personality as a whole. You could say something like, I love the way you carry yourselfyou have a perfect posture. Once again the trick here is to deliver the compliment in a matter-of-fact manner, with a genuine smile and direct look. If you appear uncomfortable or have a shifty look in your eyes, she could be confused about what exactly your words imply.\r\n \r\n\r\nAs long as youre with me, I dont care where we go.\r\nThis is one of the sweetest things a man could say to a woman, indicating that nothing matters more to him than her company. The secret to paying the perfect compliment to a woman is to make her feel good about herself. This will not only help her relax and look forward to being with you but also make you appear the perfect companion who is genuinely interested in knowing her better.', 30, 52, '2012-10-15 23:10:54', 'Show');
