INSERT INTO `post` VALUES(539, 'Police parade two suspected killers of UNIPORTThe police in Rivers State on Tuesday paraded two of the suspected killers of four students of the University of Port Harcourt.\r\n\r\nThe two suspects  David Chinasa Ugbaje and Ikechukwu Louis Amadi  were allegedly part of the mob that stripped, tortured and killed Lloyd Toku, Ugonna Obuzor, Chiadika Biringa and Tekena Erikena before setting them ablaze on October 5, 2012 in Omuokiri Aluu community.\r\n\r\nThe suspects, who were paraded in Port Harcourt, are expected to be arraigned on Wednesday for the murder of the students.\r\n\r\nThe police are still on the trail of a student of UNIPORT, Coxson Lelebori, who incited the mob to attack the students when they came to his house to collect a debt he was owing one of them. students:', 80, 265, '2012-10-16 15:09:22', 'Show');
INSERT INTO `post` VALUES(540, 'Man throws wife into pit latrine in Ogun:\r\nOgun  Police Command on Tuesday in Abeokuta paraded a suspect  for allegedly killing his wife  by throwing her into a pit  latrine  over a misunderstanding.\r\n\r\nThe State Commissioner of  Police, Mr. Ikemefuna Okoye, told newsmen that the 46-year-old unemployed man committed the act  on October 7  at Agbado area of the state, the News Agency of Nigeria reports.\r\n\r\nThe Agbado Division had a distress call that a man had  pushed his wife into a deep pit;  we quickly rushed to the scene where the victim was met dead in the pit.\r\n\r\nThe suspect was immediately apprehended and we are still interrogating him;  he will be charged to court as soon as we are done with our investigations, Okoye said.\r\n\r\nThe command also paraded an 80-year-old man and his  64-year wife  over  an allegation of  illegal possession of firearms.\r\n\r\nOkoye said  the couple were arrested on October  13 after  the police conducted a search on their   house at No 21 Obarinwa street, Aiyegbami, Ago-Iwoye.\r\n\r\nThe DPO of  Ago-Iwoye, Stephen Iriavbijeh,  got information that the couples son is a notorious robber and he led a team to conduct the search.\r\n\r\nOn getting there, the suspect was not seen but while executing the search warrant, one cut-to-size gun, two locally made pistols and 16 live cartridges were recovered in his mothers wardrobe.\r\n\r\nThus,  we arrested the  two of them in whose possession we found  the firearms  for thorough interrogation, he said.\r\n\r\nOkoye appealed to members of the public to assist the police with useful information that could lead to the arrest of criminals in the state.\r\n\r\nThe commissioner assured them that their identity would be treated with utmost confidentiality.\r\n\r\nAccording to him, the police are working round the clock to ensure the safety of lives and property.', 80, 265, '2012-10-16 15:10:46', 'Show');
