INSERT INTO `post` VALUES(542, 'Police arrest debtor who set up UNIPORT students  Suspects: Yes, we beat them, but :The police on Tuesday announced a major breakthrough in their investigation into the lynching of four University of Port Harcourt students. The videotaped lynching of the students sparked outrage nationwide and the clip of the killings went viral on the Internet.\r\n\r\nThe IG disclosed the arrest during a security meeting with Chief Executive Officers and security officers of banks at the Force Headquarters, Abuja.\r\n\r\nI want to announce that we have made a breakthrough in the Aluu killings. The two main suspects in the case have been arrested and they will be prosecuted, he said. The arrest brings the number of suspects arrested by the police to 23.\r\n\r\nThe students were set upon by a mob in Aluu, a community close to the university, and lynched. They were later identified as 19-year-old Lloyd Toku ( 200 level Civil Engineering); 18-year-old Ugonna Obuzor (200 level  Geology student); 20-year-old Chiadika Biringa, (200 level Theatre Arts student); and Tekena Erikena, a 20-year-old  a diploma (Technical) student by the management of the university.', 80, 265, '2012-10-16 23:35:36', 'Show');
INSERT INTO `post` VALUES(543, 'Woman dies after husband pushes her into latrine:The police in Ogun State have arrested a 46-year-old unemployed man, Surajudeen Alaraba, for allegedly killing his wife, Rauda, by pushing her into a pit latrine in their Agbado residence.\r\n\r\nThe police also arrested an octogenarian, Gorge Dada, and his 64-year-old wife, Sidikat, for alleged illegal possession of firearms.\r\n\r\nThe couple were said to be parents of an alleged notorious armed robber, Adeyemi Dada.\r\n\r\nParading the suspects on Tuesday at the state command headquarters, Eleweran, the Commissioner of Police, Ikemefuna Okoye said Alaraba allegedly threw his wife into a latrine over a domestic misunderstanding around 7.20pm on October 7 resulting in her death.\r\n\r\nOkoye said the unemployed man still undergoing interrogation and would soon be charged to court.', 80, 265, '2012-10-16 23:42:52', 'Show');
INSERT INTO `post` VALUES(544, 'EMA boosts DBanjs profile:\r\nDespite the hullabaloo that has greeted DBanjs parting of ways with Don Jazzy, there is an indication that his influence in Africa is still intact. Some have expressed the fear that both former MoHits generals stand the risk of losing their grips on the scene, since their partnership had been mutually beneficial. Such people have cited the fact that the songs that have so far emerged from both camps after the divorce have not been very impressive.\r\n\r\nBut for DBanj, his emergence as the Best African Art of the 2012 MTV EMA has somehow reinforced his ratings. After a tough competition across all sub-Saharan Africa, MTV on Tuesday announced the victory, saying DBanj received the most votes from fans across sub-Saharan Africa.\r\n\r\nOf course, the feat may also mean that DBanj is set to break the jinx that most Nigerian musicians that decided to seek greener pastures abroad had not been able to do  that of doing profitably the way they used to do at home. Indeed, it has been a professionally fatal flight for some of them who, apart from failing to capture the world outside, fail to regain their positions when they return to the fatherland.\r\n\r\nHosted by supermodel, entrepreneur and hometown girl Heidi Klum, the 19th annual EMA show will broadcast live from Frankfurts historic Festhalle on Sunday 11 November at 22:00 CAT on MTV (DStv Channel 130).\r\n\r\nDbanj has previously won Best African Act at the 2007 MTV EMA, Artist of the Year at both the 2008 and 2009 MTV Africa Music Awards, and Best International Act: Africa at the 2011 BET Awards.\r\n\r\nI am once again humbled by the support that you have all shown me. You guys have made me all I am, and I want to thank my loyal fans who voted me to win EMA from the bottom of my heart. Eja Nla is grateful Oluwa is involved! Ooossshhheee! Dbanj said after the announcement.', 80, 265, '2012-10-16 23:47:35', 'Show');
