INSERT INTO `post` VALUES(565, 'We wont stop Falcao leaving Atletico boss:\r\nAtletico Madrid president Enrique Cerezo has admitted the club are powerless to stop Radamel Falcao leaving should a team match his buyout clause.\r\n\r\nThe Spanish side revealed it may have to sell its star striker with continuing financial problems whilst the Colombian forward has been linked with a move to Manchester City, Chelsea and Real Madrid in recent months.\r\n\r\nCerezo was forced to concede Atleti cannot keep the former Porto man from leaving should the fee be triggered.\r\n\r\nIf they come along with his release clause; if they bring the money, they pay it and the player agrees, he doesnt even have to say goodbye, Cerezo told a Madrid television channel.\r\n\r\nThe issue is there, but I think that Falcao is a responsible person, a man who understands what a contract is, what his situation is and that hes in the team he wants to be in.\r\n\r\nCerezo however, believes Falcao will remain at Los Rojiblancos as he is content with life at Vicente Calderon and stated he does not think the Europa League holders will add to their squad when the transfer window opens in January.\r\n\r\nHes very happy here and whilst that remains the case he will be an Atletico Madrid player. I dont think well sign anyone, because we have a small but very complete squad, he said.\r\n\r\nDiego Simeones side is currently joint top of La Liga with Barcelona after picking up 19 points from seven games.', 80, 265, '2012-10-19 07:54:23', 'Show');
INSERT INTO `post` VALUES(566, 'AY apologizes to Kenny Ogungbe:\r\nFunnyman Ayo AY Makun has apologized to Kenny Keke Ogungbe and Dayo D1 Adeneye,for cracking a joke about their Grammy Awards attendance, which they found derogatory.\r\n\r\nin a lengthy open letter posted on his Facebook page, AY said it was only a harmless joke that meant neither vilification nor slight. He further explained that the joke was only a spontaneous exaggeration by a comedian who needed to just lie to the world and make a living from it.', 80, 265, '2012-10-19 07:56:01', 'Show');
INSERT INTO `post` VALUES(567, 'Nigeria is at war Soyinka:\r\nNOBEL Laureate, Prof. Wole Soyinka, on Thursday said recent developments in Nigeria portrayed it as a country at war.\r\n\r\nSoyinka also described the current killings in parts of the country as an ongoing war between the forces of good and evil.\r\n\r\nSpeaking at the presentation of Port Harcourt as the UNESCO World Book Capital for 2014, he said Nigerians would cease to be human beings if they yield to evil forces.\r\n\r\nSoyinka, who condemned the murder of four students of the University of Port Harcourt and the Mubi killings, noted that the forces of evil were out to wipe out any trace of enlightenment and creativity in the country.\r\n\r\nThe Nobel Laureate urged literary minds in the country not to see themselves as authors, writers and readers, but as part of a creative army against the forces that had come to extinct creativity.\r\n\r\nHe said, I believe quite frankly this country is at war; the war is between the forces of darkness and the forces of light, the forces of intellect, the forces of rationality and the forces of atavism, retrograde thinking, the forces of hatred against humanism.\r\n\r\nI believe that if we surrender to these banal forces in our society, we cease to be human beings because we succumb completely to fear and it is the same message we must take to those in this nation, who believe that books are wrong.\r\n\r\nI dont care whether they call themselves the final defenders of the pure road and the ultimate salvation or call themselves Boko Haram.\r\n\r\nBoko Haram and all organisations, all movements that wage war against books, against literacy, against education and enlightenment in any form have declared war, not on the state, but on humanity itself and in spite of such setbacks, in spite of such horrors, we have the responsibility to support and to sustain efforts such as being made by the Rainbow Club and allied societies and organisations.\r\n\r\nHe stated that the recognition of Port Harcourt as UNESCOs World Book Capital was an indication that something was going right in the country.\r\n\r\nSoyinka added, One plea that I want to make to my fellow writers, authors everywhere is that we are not just engaged in the business of writing books; we are part of a large army of creative people.\r\n\r\nEarlier, the Rivers State Governor, Mr. Rotimi Amaechi, said his administration had been investing in the education of the people of the state.\r\n\r\nRepresented by the  Commissioner for Information and Communications, Mrs. Ibim Semenitari, the governor explained that such investment was aimed at growing a literate citizenry that would be able to take the state to the next level of development.', 80, 265, '2012-10-19 07:57:09', 'Show');
INSERT INTO `post` VALUES(568, 'Police dismiss Sergeant who ordered students lynched:\r\nTHE police on Thursday said the policeman involved in the killing of the four students of the University of Port Harcourt in Aluu, Rivers State, Sergeant Lucky Orji, had been dismissed from the force.\r\n\r\nThe spokesman for the police in Rivers, Mr. Ben Ugwuegbulam confirmed to our correspondent in Port Harcourt that Orji had been dismissed and that he was among the 13 suspects arraigned in court on Wednesday.\r\n\r\nHe (Orji) was among those arraigned in court yesterday (Wednesday). He is no longer a policeman because he has been dismissed, Ugwuegbulam said.\r\n\r\nThe four male students, Lloyd Toku, Ugonna Obuzor, Chiadika Biringa and Tekena Erikena, were beaten and set ablaze by a mob suspected to be residents of Omuokiri Aluu, a community located about three kilometers to UNIPORT.\r\n\r\nThirteen suspects, including the traditional ruler of the community, were arraigned in court on Wednesday.', 80, 265, '2012-10-19 07:58:17', 'Show');
INSERT INTO `post` VALUES(569, 'Tonto Dikeh disappoints with debut single:\r\nIn the last 48 hrs, Tonto Dikehs latest singles, Hi and Itz Ova, have become two of the most listened and downloaded tracks, with over 500,000 views.\r\n\r\nDikeh, who joined the bandwagon of other actors who succumbed to the moonlighting itch to delve into singing, has been lampooned and criticised for the lack lustre quality and uninspiring singles which went viral shortly after its release on Wednesday.\r\n\r\nAfter announcing the planned release of singles last week, the actress was advised by fans and critics to forget music and concentrate on acting.\r\n\r\nIronically, Hi and Itz Ova have caused a Twitter disaster and left in its trail criticisms and knocks, mostly from disappointed fans over the auto-tune assisted tracks.\r\n\r\nAs if coming from an ill-advised artiste, the song which lacks cohesion from start, ends up losing the listener at some point, as the singer also sounds unsure of her lyrics. The over-use of lewd lines is also a cause for concern, especially for younger listeners.', 80, 265, '2012-10-19 07:59:51', 'Show');
INSERT INTO `post` VALUES(570, 'Drake''s High School Diploma: ''One Of The Greatest Feelings In My Entire Life''\r\nRapper finally graduated from high school after dropping out to be on ''Degrassi.'':\r\n\r\nSometimes dropping out of high school is a good thing. Take Aubrey Graham, 25. While his mom was probably not psyched that he bailed on the books as a teenager, the rapper, better known as Drake, kind of made it work for him.\r\n\r\nWell, Drizzy made it official recently, announcing to his Twitter followers that after leaving Toronto''s Forest Hill Collegiate Institute as a teen to take a spot on ', 80, 265, '2012-10-19 08:10:24', 'Show');
INSERT INTO `post` VALUES(571, 'Megan Fox, Brian Austin Green Welcome Baby Boy\r\nCouple gave birth to their first child together last month.:\r\nt''s a boy for Megan Fox and Brian Austin Green. Fox confirmed on her Facebook page that the couple have welcomed their first son into the world.\r\n\r\nFox gave birth to their baby boy, Noah Shannon Green, on September 27. ', 80, 265, '2012-10-19 08:13:12', 'Show');
