INSERT INTO `post` VALUES(574, 'Police kill robbery suspect, recover stolen vehicle:\r\nhe police in Abuja on Thursday night gunned down an armed robbery suspect who snatched a Toyota Highlander Sport Utility Vehicle at Garki Area 11 and attempted to rob a supermarket with two other suspects.\r\n\r\n The jeep was recovered along with an SMG rifle, nine live ammunition and three cell-phones.\r\n\r\nThe two accomplices of the dead robbery suspect escaped, but the police said they were working to apprehend them.\r\n\r\n The Divisional Police Officer in charge of the Central Police Station, Wuse, Chief Superintendent of Police Haruna Garba, said that he received a distress call around 8.15 pm that a robbery operation was going on at a supermarket', 80, 265, '2012-10-19 22:56:06', 'Show');
INSERT INTO `post` VALUES(575, 'Why P-Square and I dont belong to any collecting society Jude Okoye:\r\nSince many music fans have been itching to find out why P-Square are one of the few groups operating on the music scene without a necessary backup from a collecting society, the manager of the twin brothers and their sibling John Okoye, has spoken up.\r\n\r\nWe have been in show business long enough and experienced the joy and pain to know that collecting societies are not the solution to the problems facing the music industry, Okoye told LIFE&amp;BEAT\r\n\r\nThe major problem is piracy. We want the Federal Government to approve and empower a body or agency in the mould of NAFDAC to tackle the problem. The entertainment industry urgently needs a national agency to tackle piracy, copyright law violators and royalty defaulters.\r\n\r\nP-Square and our companies, Square Records and Northside Entertainment, have not joined any collecting society because we dont want to give any organisation the power to collect royalties on our behalf without showing a keen interest in solving our greatest problem, which is piracy. It doesnt make sense.\r\n\r\nIm not against any collecting society. But come to me as an approved body recognised by the government to fight piracy and I will carry you on my shoulder because I know there will be more money at the end of the day for me. Also, I would know that my future is guaranteed.', 80, 265, '2012-10-19 22:57:49', 'Show');
INSERT INTO `post` VALUES(576, 'Im not dating Tiwa Savage Flavour:\r\nFlavour (real name, Chinedu Okoli), a singer, has finally silenced those spreading the rumour that he is involved in a sizzling romance with Tiwa Savage.\r\n\r\nThe tale bearers had been encouraged by the kiss shared by both artistes in the video of the hit song, Oyi, to go to town with the story that they were dating each other.\r\n\r\nBut Flavour dismissed the rumour as false. Whoever has seen the video may not believe it. But the truth is that Tiwa and I are not involved in any romance. I am not dating her and she has never been my lover, though she is beautiful, talented and fun to work with. Both of us just happened to work together, he said.\r\n\r\nMaybe the tale bearers will give him a well deserved break after this.', 80, 265, '2012-10-19 22:58:51', 'Show');
INSERT INTO `post` VALUES(577, 'Femi Kuti, Ali Baba, K1, others condemn Aluu killings:\r\nNigerian artistes and comedians have condemned the lynching of four students of the University of Port Harcourt by some residents of Aluu community in Rivers State.\r\n\r\nThose who kicked against the killings are ace comedian, Ali Baba, Stella Monye, Sound Sultan, Tuface Idibia, Atorise, Nkem Owoh, K1, Omotola Jalade-Ekinde, Muma G, Weird MC, Jimmy Jatt, P-Square and Tiwa Savage.\r\n\r\nAfrobeat musician, Femi Kuti, had to cancel an appointment with a radio station in France, where he is currently on tour, after he saw the video of the gruesome murder of the students.\r\n\r\nI have seen the video of the lynching. It goes to show how successive governments in Nigeria have destroyed the minds of the people through bad leadership. Now, it seems to some people that taking the lives of fellow countrymen and women has become as natural as looting the national treasury with impunity and without regard for law and order.\r\n\r\nI mourn the death of these four young undergraduates. I am so ashamed right now that Nigeria has become a jungle where life has no meaning to the majority that have been robbed of their share of the commonwealth by corrupt leaders, he said.\r\n\r\nIn his reaction to the killings, DBanj said, I woke up to yet another avoidable tragedy. Four young men, Lloyd, Ugo, Tekena and Chidiaka, all undergraduates with great dreams and a promising future, were brutally murdered. After watching the video, something died inside of me. Although my heart goes to their parents, this is our collective loss as a nation and Nigerian youths. We are not a nation of barbarians, so, we must ensure that justice prevails.', 80, 265, '2012-10-19 22:59:52', 'Show');
INSERT INTO `post` VALUES(578, 'Robbers, kidnappers devise new tactics in Akwa Ibom:\r\nSince the Akwa Ibom State Government banned commercial motorcycles in Uyo, the capital, residents have been having a hard time coping with the activities of robbers and other criminals.\r\n\r\nMany residents have lost their possessions to armed robbers while commuting in commercial tricyles, the alternative means of transportation in the city.\r\n\r\n Recounting her experience to CRIME DIGEST in Uyo, one of the victims, Kindness Effiong, 24, said, We were only two passengers in the tricycle, a woman and myself. We were heading to Nwaniba. The tricycle had hardly moved a short distance when a man beckoned on the rider, walked up to him and asked to be taken to Osongama Housing Estate. The rider then proceeded to Osongama without seeking our consent.\r\n\r\nImmediately the tricycle got to a secluded area, the man began to drag our bags. As we struggled to wrest the bags from him, he brought out a gun and pointed it at us. We surrendered everything we had to him. The robber and the rider ordered us to get down from the tricycle and they zoomed off.', 80, 265, '2012-10-19 23:01:06', 'Show');
