INSERT INTO `post` VALUES(580, 'Scores die, schools, LG HQs burnt in Maiduguri, Potiskum terror attacks:\r\nAttacks and gunfights between suspected Islamists and security forces in a north-eastern Nigerian town have killed several people and destroyed buildings, residents and authorities said on Friday, while unrest also hit another city, the French News Agency reported.\r\n\r\nExplosions and gunfire shook the city of Potiskum, sparking panic and chaos, from late Thursday, residents and security forces said. Residents reported several dead as well as schools and a government building burnt.\r\n\r\nIn the city of Maiduguri, also in the northeast and the base of Islamist extremist group Boko Haram, gunfire and several explosions could be heard on Friday, an AFP correspondent said. But details were not immediately clear.', 80, 265, '2012-10-20 08:44:40', 'Show');
