INSERT INTO `post` VALUES(591, 'SSS summons Senator Zanna over Boko Haram commander:\r\nThe State Security Service has summoned a serving Senator, Ahmed Zanna, over his alleged involvement with the violent Islamic sect, Boko Haram.\r\n\r\nThe summons is in connection with the arrest last week of a suspected member of the group, Shuaibu Bama, in a house believed to be the senators.\r\n\r\nThe Joint Task Force had arrested Bama in the building along Damboa Road in Maiduguri, the Borno State capital, last Friday after soldiers stormed the House.\r\n\r\nThe JTF had claimed that Bama was one of the commanders of the sect, who had been under watch.', 80, 265, '2012-10-21 23:00:00', 'Show');
INSERT INTO `post` VALUES(592, 'Mayflower School co-founder, Sheila Solarin dies at 88:\r\nSheila Solarin, widow of the late renowned social critic, Dr. Tai Solarin, is dead.\r\n\r\nWe learnt that Sheila, 88, died on Sunday afternoon at the Babcock University Teaching Hospital, Ilishan Remo, Ogun State.\r\n\r\nShe had reportedly slipped while going to bed some months back and was rushed to the hospital where she was operated upon.\r\n\r\nSheila was reported to have sustained a broken hip as a result of the domestic accident.\r\n\r\nSheila died at about 4.30pm on Sunday at the hospital. Her two children were said to have been by her bedside at the hospital when she passed on.\r\n\r\nHer remains, according to family sources, have been deposited at the Lagos State University Teaching Hospital Morgue.\r\n\r\nThe daughter of the deceased, Ms. Corin Solarin, said she was short of words to describe the life and times of her late mother.', 80, 265, '2012-10-21 23:01:40', 'Show');
INSERT INTO `post` VALUES(593, 'Rihanna Attends Chris Browns Qubeey Launch Party:\r\nChris Brown celebrated the launch of his Qubeey Channel, a customized site that will allow his fans gain more access to his photos, videos, and all things Chris Brown, and Rihanna was there to support her man. The launch party held last night at the Playhouse nightclub in Beverly hills.', 80, 265, '2012-10-21 23:05:14', 'Show');
INSERT INTO `post` VALUES(594, 'Bishop David Oyedepo accused of exploiting British worshipers:\r\nThis is a story published by UK Daily Mail this morning. They are accusing Bishop Oyedepo''s Winners Chapel of exploiting their worshipers and receiving over 16 million in donations from them..\r\n\r\n    A church run by a controversial multi-millionaire African preacher has been accused of cynical exploitation after its British branch received 16.7million in donations from followers who were told that God would give them riches in return.\r\n\r\n    Followers are ferried in double-decker shuttle buses to the church, handed slips inviting them to make debit card payments, and are even told obeying the ministrys teachings will make them immune from illness.\r\n\r\n    Todays Mail on Sunday revelations about the Winners Chapel movement have prompted the Charity Commission to review the charitable status  of the church  one of the fastest-growing in the UK.', 80, 265, '2012-10-21 23:06:59', 'Show');
