INSERT INTO `post` VALUES(613, 'Okada riders protest police harassment, vandalize BRT buses:\r\nCommercial activities were disrupted for hours in Onipanu, Fadeyi, Mushin and Ijora areas of Lagos State on Monday after scores of commercial motorcycle operators otherwise known as okada riders went on the rampage to protest against police harassment and the states traffic law.\r\n\r\nThe state government had on August 2, 2012, signed into law, the restriction of commercial motorcycles on 475 roads, specifically, bridges, expressways and double-carriage roads.\r\n\r\nLast Monday, the police began a clampdown on okada riders resulting in seizure of motorcycles and harassment of the riders.', 80, 265, '2012-10-22 22:43:51', 'Show');
