INSERT INTO `post` VALUES(617, 'Rihanna and Chris Brown caught getting cozy at party:\r\n\r\nJust weeks after breaking up with his girlfriend, Karrueche Tran, over the weekend, Chris Brown was spotted getting cozy with his ex-girlfriend, Rihanna. Brown held a launch party for his new Internet channel on Qubeey.com at a private location in Beverly Hills. RadarOnline.com reports that the singer was caught getting quite close to Rihanna on a sofa. The pair was spotted hugging and sharing drinks and a cigarette with each other.\r\n\r\nOver the past few weeks, Chris dumped his girlfriend Karrueche Tran and even released a video claiming to be inlove with two people.', 80, 265, '2012-10-23 10:23:35', 'Show');
