INSERT INTO `post` VALUES(626, 'Wardrobe Malfunction Be Damned! Nicki Minaj Strategically Avoids Nip Slip on Stage:\r\nTalk about being prepared!\r\n\r\nSeeing how Nicki Minaj is no stranger to inadvertently exposing too much of herself while performing, the gal was obviously ready for another possible wardrobe malfunction to happen when she took the stage at Manchester Arena on Monday night to kick off the U.K. leg of her tour.\r\n\r\nSure enough, soon after she began belting out her hits, Minaj''s breasts began to make their way slightly out of her tight black bustier. Fortunately, though, any nip slips were avoided thanks to some well-placed pasties.', 80, 265, '2012-10-24 02:25:24', 'Show');
INSERT INTO `post` VALUES(627, 'Teacher flogs 12-year-old pupil to death\r\nA 12-year-old pupil of a secondary school in Awka, Anambra State, Miss Chidimma Ukachukwu, has died after she was allegedly flogged by her teacher for failing to do her homework.\r\n\r\nA reliable source in the school told the News Agency of Nigeria in Awka on Tuesday that the girl died on Thursday last week after she was flogged.\r\n\r\nThe source explained that the girl fainted after being flogged severally by a female teacher and was subsequently rushed to an undisclosed hospital, where she died.', 80, 265, '2012-10-24 02:28:54', 'Show');
INSERT INTO `post` VALUES(628, 'Okada riders damaged 42 buses  LAGBUS, LAMATA:\r\nThe management of LAGBUS Assets Management Ltd on Tuesday said that 37 of its buses were damaged during the protest by commercial motorcycle riders in Lagos on Monday.\r\n\r\nThe company is one of the operators of buses using the dedicated Bus Rapid Transit lanes in the metropolis.\r\n\r\nMr. Babatunde Disu, Managing Director of LAGBUS, told the News Agency of Nigeria that in spite of the damage, no passenger was injured.', 80, 265, '2012-10-24 02:32:01', 'Show');
