INSERT INTO `post` VALUES(643, 'Obasanjo Seizes 10 LAGBUS after Lagos Governor Fashola Impounds His Vehicles:\r\n\r\nbasanjo Seize 10 lag busIn an action that could be described as that of a power drunk leader, former President, Chief Olusegun Obasanjo has allegedly confiscated 10 LAGBUS buses, and kept them at the premises of his Obasanjo Farms, Ota, Ogun State, southwest Nigeria.\r\n\r\nWe learnt Obasanjo took the action after officials of the Lagos State Traffic Management Authority, LASTMA impounded a sport utility vehicle, SUV, belonging to Obasanjo Farms at the weekend in Lagos.\r\n\r\nThe former president reportedly made a futile attempt to get his SUV released but his intervention did not yield the desired result.\r\n\r\nIt was gathered that in retaliation, Obasanjo ordered his aides to impound LAGBUS buses plying, Lagos/Ogun route.\r\n\r\nWitnesses told us this morning that at least 10 LAGBUS buses had been impounded and parked in the premises of Obasanjo Farms since last weekend.', 80, 265, '2012-10-25 12:20:54', 'Show');
INSERT INTO `post` VALUES(644, 'Lagos Now A Living Hell Without Okada:\r\n\r\nFor a couple of days now, living in Lagos has become a sort of hell to some people. No thanks to the ban on commercial motorcyclists, otherwise known as Okada from plying some roads in the state.\r\n\r\nThe enforcement of the ban took a new dimension early this week when the okada operators took to the streets to protest indiscriminate arrest of their members and subsequent seizure of their motorcycles, and the process, destroyed public facilities including BRT buses.', 80, 265, '2012-10-25 12:21:58', 'Show');
