INSERT INTO `post` VALUES(652, 'Chris Browns ex determined to get rid of Rihanna:\r\nA few weeks ago, Chris Brown broke up with Karrueche Tran over his friendship with ex-girlfriend, Rihanna. Since their breakup, Brown has been spotted in nightclubs, getting pretty intimate with RiRi. However, TMZ reports that Tran still believes she has a future with Brown and has not stopped loving him. A source close to the model claimed Tran is on a mission to get Brown back and will not stop because Rihanna is back in the picture.', 80, 265, '2012-10-26 00:58:50', 'Show');
INSERT INTO `post` VALUES(653, 'Wonder Girls love Akon!\r\n\r\nWith Psys Gangnam Style breaking through and crossing over to the American charts, it seems the K-Pop invasion is on! Wonder Girls are the latest Korean group scoring a hit single in the States with Like Money, which features Akon.', 80, 265, '2012-10-26 01:00:46', 'Show');
INSERT INTO `post` VALUES(654, 'Justin Bieber reaches three-billion Youtube views:\r\nJustin Bieber has become the first person to reach three-billion views on YouTube. The singers latest video for Beauty and a Beat featuring Nicki Minaj helped him reach his goal after becoming the most-viewed video for a 24 hour period, a titled it earned right after it was uploaded. Digitalspy.com reports the video accumulated 44- million views by itself. Beauty and a Beat will receive its official release on November 12th, but is available to download on iTunes now.', 80, 265, '2012-10-26 01:10:25', 'Show');
