INSERT INTO `post` VALUES(673, 'Suicide bomber hit us during Holy Communion  Survivors15 killed, 100 injured in Kaduna church bombing, reprisals:\r\n\r\nThe suicide bomber who killed eight Catholic worshippers in Kaduna on Sunday drove into the church as worshippers knelt praying and the priest was serving the Holy Communion, eyewitnesses and survivors said.\r\n\r\nThe bombing, which happened at the St. Ritas Catholic Church, Ungwan Yero, Malali, Kaduna State, also left  100 injured. However, seven persons were reportedly killed in the reprisals that followed the blast.\r\n\r\nA victim, Jacinta Oko, said, We just heard the loud sound of the bomb blast when we were preparing to take Holy Communion. Before I knew what was happening, I found myself on the ground. I can say that so many people died because it affected the side where the choir members were sitting.', 80, 265, '2012-10-29 03:04:34', 'Show');
INSERT INTO `post` VALUES(674, 'Gulak trying to cause problem for Jonathan:\r\n\r\nThe Special Adviser (Political Matters) to the Deputy Senate President, Okey Ozoani, has said President Goodluck Jonathan does not deserve aides who lack understanding of their responsibilities.\r\n\r\nOzoani said this in a statement, in Abuja, on Sunday, while responding to remarks credited to the Special Adviser to the President on Political Matters, Mr. Ahmed Gulak.\r\n\r\nThe claims by Gulak that the National Assembly should be blamed for poor budget implementation as well as the late passage of Appropriation Act, among other allegations, Ozoani said, were spurious.\r\n\r\nOzoani added that Gulaks claims that the Deputy Senate President said most National Assembly members were illiterates was unfortunate.\r\n\r\nHe said, This coming from Mr. Gulak, who has found pleasure in courting trouble for the Presidency by his reckless statements on not just the National Assembly and its officers, but also respected elder statesmen of the Federal Republic, is not surprising.', 80, 265, '2012-10-29 03:06:03', 'Show');
INSERT INTO `post` VALUES(675, 'Okada rider hacks union leader to death:\n\nA leader of motorcycle operators association in Ondo town, Ebenezer Adedeji, was on Saturday killed by an okada rider.\n\nIt was learnt that Adedeji was the branch chairman of the Road Transport Employees Association of Nigeria, the okada riders unit in one of the parks in the town.\n\nWitnesses said Adedeji had before the incident, stood at Shora Street where he allegedly accosted the suspected killer and demanded N100, being the money for the daily ticket of the association.\n\nAn argument was said to have ensued between Adedeji and the suspect leading to a scuffle.\n\nThe suspect was said to have abandoned his motorcycle on the spot and left for his house which is located few metres to the area, only to return with a cutlass.\n\nIt was learnt that Ebenezer also left the scene to attend a meeting of the association in the area. But unknown to him, the suspect who is yet-to-be identified had allegedly laid ambush for the union leader at the entrance of the venue of the meeting.\n\nAs soon as Ebenezer came out of the meeting, the suspect allegedly hacked him down with the cutlass.\n\nThe suspect was said to have been later overpowered by the traders in the area, before he was handed over to the police.', 80, 265, '2012-10-29 03:07:57', 'Show');
