INSERT INTO `post` VALUES(677, 'Fire incident at the Plaza:\r\nTRADERS at the Euro Asia Plaza in the ever-busy Balogun Market at Lagos Island on Sunday wore gloomy faces as they lamented their losses as a result of the fire incident that wreaked havoc in the six-storey building shopping complex on Saturday evening.\r\n\r\nThe traders, mostly dealers in foot wears, crowded the area while a team of fire service personnel battled to put out the fire.\r\n\r\nThe traders told the state governor, Mr. Babatunde Fashola, who was at the scene of the fire incident to access the level of disaster, that they lost all their investments as the mysterious fire completely gutted the fourth and fifth floor, which they used as their warehouse.\r\n\r\nOne of the affected traders, Mr. George Ajeh, said the fire started at about 5p.m. when traders were closing up shop for the day, adding that it was just by Divine intervention that the occupants of the building, which housed about 500 shops, including a branch of United Bank of Africa (UBA), survived the disaster.', 80, 265, '2012-10-29 03:16:27', 'Show');
