INSERT INTO `post` VALUES(714, 'Sack Alison-Madueke, Okonjo-Iweala, boards Groups:\r\n\r\nSome civil society organisations on Wednesday in Abuja called on President Goodluck Jonathan to sack the Minister of Petroleum Resources, Mrs. Diezani Alison-Madueke, and her counterpart in Finance, Dr. Ngozi Okonjo Iweala, based on the Report of the Nuhu Ribadu-led Petroleum Revenue Task Force, which alleged corruption in the oil and gas industry.\r\n\r\nThe groups also urged the President to sack the boards and management of the Nigerian National Petroleum Corporation, Pipelines and Products Marketing Company of Nigeria, Department of Petroleum Resources and the Petroleum Products Pricing Regulatory Agency to give way for the total clean-up of the countrys oil and gas industry.', 80, 265, '2012-10-31 22:57:51', 'Show');
