INSERT INTO `post` VALUES(723, 'Okada rider beaten and stripped naked by policemen in Lagos:\r\n\r\nThe naked man in the picture is an Okada man who violated the new Lagos state traffic law. He was arrested at the junction adjoining University road and St Finbarrs college road Akoka by policemen in mufti, and before anyone could say anything, the policemen descended on the Okadaman, beating him mercilessly and then stripping him naked.\r\n\r\nThey stopped the inhuman treatment after people around gathered at the scene and begged them to stop. This is the police protecting us! SMH!', 80, 265, '2012-11-01 10:19:51', 'Show');
INSERT INTO `post` VALUES(724, 'I miss d days when we went to school, lined up &amp; D headmistress &amp; teachers inspect our nails &amp; uniform &amp; den we match to our classrooms, U Remember na??  D days of Nasco Biscuit, Trebor, Iced Coloured water tied in nylon we called it &quot;lolly&quot;. D days of Goody- Goody &amp; pako Biscuit. X_X  D days of ali &amp; simbi, Mr Salami &amp;Mrs Salami, Agbon, Edet lives in Calabar.... Chei, i remember those days when one naira na money, when groundnut was 5 kobo. &amp; choco milo sweet was 5 kobo Days of missing game (boji-bojiwo in hausa),who is in d garden, police and thief D days of mama &amp; papa play  Days when we use to build houses with sand, play &quot;suwe&quot; game, tinco tinco, change ur style, ten ten, skipping, stop! U remember nau! Those days wen we used to fly kite on streets, wen we boys used to use d paint bucket-cover as tire &amp; our daddy''s hanger as d steering Those days when rubber band (rubberling) was a stock exchange Days when votron, jimbo, power ra\nngers, spider man was our favourite cartoons  D days of limca soft drinks &amp; choco milo advert on black and white tv nd sunday rendevous by 1:30pm  when we say ''leke leke give me\nwhite finger''  Those days when eleganza pen was d best D days wen we used to drink water from d tap even suck out d water if its not coming out. D days when NTA will show rainbow color for 30 mins then national anthem before they resume program @ 4pm. D days were basket sandals, simbi nd Bata sandals were d best Days wen we all sing sandalili-sandalili songs. Damn! now DSTV has come no more old fun.I''m really proud to have experienced all this. If u r nt smiling it means u were nt born in my generation. Hit Comment if u r born in my generation, no lie o!', 80, 265, '2012-11-01 13:44:06', 'Show');
INSERT INTO `post` VALUES(725, 'EXCLUSIVE: Gay runs turn awry as UNIPORT Undergraduate''s Sex Organ Multiplies\r\n\r\nUniversity of Port-harcourt (UNIPORT) can''t stop being in the news for the wrong reasons. After the widely villified Aluu 4 massacre and the shooting of some st\r\nudents of the institution by rampaging gun-men,another student seems to have fallen victim to some diabolical machinations.\r\n\r\n\r\n\r\n\r\nObinna,21, a 200 level student of UNIPORT was reported to have developed multiple sex organs after an intensive 2 night sexcapade with his gay lover in a popular hotel in Ifako Gbagada,Lagos. He was alleged to have met the man on social networking site,Hi5 after which he was paid N20,000 for transportation to Lagos. He came and after the rendevous was paid the agreed sum of N150,000 only for him to discover in a jiffy that his penis was developing branches but lo and behold the partner was no where to be found!\r\n\r\nHe raised an alarm which attracted people to the scene. It seems youths have not learnt from the recent murder of Cynthia who was lured into her death through the social media.\r\n\r\nGuess this will teach some dudes who have converted gay escapades to a means of making fast money a lesson. You just might the next victim, desist from such acts before its too late.', 80, 265, '2012-11-01 14:42:53', 'Show');
