INSERT INTO `post` VALUES(727, 'Boko Haram wants talks picks Buhari as mediator, Saudi Arabia venue demands ex-govs arrest, compensation:\r\n\r\nTHE violent Islamic sect, Boko Haram, on Thursday  indicated its readiness  to end its  campaign of  violence but on the conditions that ex-Borno State Governor Modu Sheriff  was arrested and peace talks held in Saudi Arabia.\r\n\r\n Also, the sect is asking for compensation for families of its members killed in the course of its  terrorist acts   and the rebuilding of its mosques by the Federal Government.\r\n\r\n It also demanded the release of all its  members in the custody of security agencies.\r\n\r\nAbu Mohammed Ibn Abdulaziz, the  second-in-command to the sects leader, Abubakar Shekau, gave    the conditions on Thursday during a radio conference with journalists in Maiduguri, Borno State.', 80, 265, '2012-11-02 02:37:33', 'Show');
INSERT INTO `post` VALUES(728, 'Ex-councillor stabs teenager for refusing advances:\r\n\r\nA former Councillor of Amuwo-Odofin Local Government Area of Lagos State, Onimole Babatunde, is currently being detained at the Area E Police Command, Festac, Lagos for allegedly stabbing an 18-year-old girl in the neck after she refused his advances at a night club.', 80, 265, '2012-11-02 02:42:24', 'Show');
INSERT INTO `post` VALUES(729, 'JAMB starts computer-based test in 2015:\r\n\r\nThe Joint Admissions and Matriculation Board is to end its paper and pencil based examinations by 2015.\r\n\r\nMinister of Education, Prof. Ruqayyatu Rufai, stated this at the inauguration of the boards of the computer-based testing in Abuja, on Thursday.\r\n\r\nRufai expressed the hope that in the next three years, all JAMBs conducted examinations would be computer based.', 80, 265, '2012-11-02 02:43:56', 'Show');
INSERT INTO `post` VALUES(730, 'Tonto Dike debuts in cinema in My Life My Damage:\r\n\r\nControversial actress, Tonto Dikeh is in the news again but this time it is about her cinema debut MY LIFE, MY DAMAGE, from the Damage Trilogy, produced by actress/producer, Uche Jumbo.\r\n\r\nIn this movie, Dikeh, famous for her weird acting, depicts the character a young lady who lives a reckless life abroad as a drug addict, receives a rude shock when she discovers that she is HIV positive. The film which also stars Bukky Wright, Biola Williams, Bobby Obobo and Kalu Ikeagwu,  is part of The Damage series which is a movie collection of three distinct but interwoven stories aimed at advocacy for social issues. Each story addresses important problems affecting individuals, families and societies at large.', 80, 265, '2012-11-02 02:46:43', 'Show');
