INSERT INTO `post` VALUES(734, 'Boko Haram kills retired general in Maiduguri:\r\nBoko Haram gunmen on Friday shot and killed a retired general, Mamman Shuwa, in Maiduguri, Borno State.\r\n\r\nShuwa is an ally of a former governor of Borno State, Modu Sheriff.\r\n\r\nShuwa, who is a former minister of communications, will be buried on Friday evening.\r\n\r\nBorno State Governor, Kashim Shettima, is expected to attend the burial.\r\n\r\nShuwa was also a Borno elder and one of the influential citizens of the state who were consulted by the National Security Adviser, Col. Sambo Dasuki (retd.), in June.\r\n\r\nDasuki had shortly after his appointment embarked on shuttles to some Northern cities to seek solutions to the bloody campaign of the violent Boko Haram sect.', 80, 265, '2012-11-02 08:32:16', 'Show');
INSERT INTO `post` VALUES(735, 'Trailer kills Ondo LG boss, injures three others:\nA trailer on Thursday night crushed the Caretaker Chairman of Akoko. South-West Local Government, Ope Adefarati, and injured three others in Iwaro-Oka area of the state.\n\nIn the incident, which occured around 8.25p.m, the trailer was said to be descending the Oke Maria hill when its driver lost control and crashed into a Toyota Camry car in which the chairman and three others were travelling.\n\nAdefarati died on the spot while the other three, including her police orderly, were seriously injured.\n\nThe trailer driver had earlier killed one person before running into Adefaratis car.\n\nTwo corpses were deposited at General Hospital, Ikare while the injured are receiving medical attention.', 80, 265, '2012-11-02 08:36:41', 'Show');
INSERT INTO `post` VALUES(736, 'Drama as Oronsaye, Oti reject Ribadu probe report:\nThere was a mild drama on Friday as two members of the petroleum sector probe panel headed by former chairman of the Economic and Financial Crimes Commission, Mallam Nuhu Ribadu, raised objections to the report.\n\nThe members  Steve Oronsaye and Ben Oti  raised the objections when the committee was to submit the report to President Goodluck Jonathan.\n\nOronsaye claimed that the process of compiling the report was faulty.\n\nHowever, Ribadu insisted that the submitted report was the same as the one that was leaked to Reuters last week.\n\nOronsaye also alleged that the report did not reflect the positions of all members, saying they were not carried along.\n\nBut Ribadu fired back, accusing the former head of service of the federation of staying away from meetings.\n\nHe said both Oronsaye and Oti were compromised with government appointments while still serving on the committee.\n\nTo resolve the stalemate, Jonathan advised Oronsaye, Oti and any other members with divergent views to send their separate reports to him', 80, 265, '2012-11-02 08:38:49', 'Show');
INSERT INTO `post` VALUES(739, 'Jonathan promises assistance to root out Al-Qaeda from Mali:\r\nPresident Goodluck Jonathan on Friday promised that Nigeria would give technical support to the Malian military to root out Al-Qaeda in the West African country.\r\n\r\nJonathan made the promise when he received the German Foreign Minister, Dr. Guido Westerwelle, at the Presidential Villa, Abuja.\r\n\r\nWesterwelle is in Nigeria for the Nigeria-German Bi-National Commission meeting.\r\n\r\nJonathan said interactions with a cross-section of Malians during his visit to the country recently showed a desire for peace and a commitment to remove the rebels from northern Mali.', 80, 265, '2012-11-02 22:35:29', 'Show');
INSERT INTO `post` VALUES(740, 'Hummer Jeep-owning sergeant rearrested for robbery while on bail:\r\nhe tale of how of a new generation bank at Akowonjo, Lagos, was robbed last year wont be complete without the mention of Eboma Onyeka, a sergeant who was at the time of the incident attached to the Mobile Police Unit 20, at Ikeja. \r\n\r\nOnyeka had allegedly conspired with four others, including an employee of the said bank and robbed the bank he was to secure of about N10m in April 2011.  A security guard attached to the bank, Sunday Ogundipe, was strangled in the process. Two months after, Onyeka was arrested, tried and dismissed from the force before he was arraigned with his accomplices on armed robbery and murder charges in July 2011.\r\n\r\nHowever, Onyeka is once again a guest of the Special Anti-Robbery Squad, Lagos, months after securing his bail. He is said to have allegedly been involved in a series of bank ATM robberies since his bail from Kirikiri Prisons in December 2011.', 80, 265, '2012-11-02 22:37:21', 'Show');
INSERT INTO `post` VALUES(741, 'No special treatment from Don Jazzy DPrince:\r\nDPrince has waved aside insinuations that his older brother and boss of Mavin Records, Don Jazzy, treats him specially and above the other artistes on the label.\r\n\r\nIt is not true that I enjoy special treatment from Don Jazzy. He handles my works the same way he does every other artistes on the label. He does not allow family bond to interfere with his music business or production.\r\n\r\nIn fact, every artiste on Mavin works according to his timetable. Don Jazzy decides whose album will be released next. He is a caring boss and we all respect his creativity and judgement.\r\n\r\nThe fact that my debut solo album is coming out first does not mean that Im getting a special tr eatment. The album titled Freazy has been scheduled to be released since the days of Mo Hits Records.\r\n\r\nWhen it comes to music production, Don Jazzy is a perfectionist. He makes you hungry for success by making you stand in line; learning in the studios, as well as on the different stages as a performer. He imparts to you the team spirit even as a solo recording artiste, he said.', 80, 265, '2012-11-02 22:38:21', 'Show');
INSERT INTO `post` VALUES(742, 'All eyes on Fiberesima, new AGN boss:\r\nIbinabo Fiberesima made history recently when she emerged the first female president of the Actors Guild of Nigeria. As expected, many notable actors and actresses attended her inauguration last Sunday at the upscale Rumours Night Club in Lagos.\r\n\r\nFor the first time in a long while, the event was well attended and the actual handing over took place in a warm and peaceful atmosphere. The turn-out signalled an end to the internal squabbles and controversies that had almost diminished the worth of the AGN.', 80, 265, '2012-11-02 22:39:08', 'Show');
INSERT INTO `post` VALUES(743, 'Day robbers dared police in Somolu:\r\nIt was a subdued Sallah celebration for residents living of Somolu, Lagos, last Friday as a group of robbers chose the day to invade the community.\r\n\r\n  Armed men numbering about 20, in the wee hours of Oct. 26, stormed Fola Agoro Street. They stole two vehicles: a black Murano jeep with registration EC 480 GGE and a red Nissan Quest with registration number XM 03 SA.\r\n\r\nThe robbers invaded a building on Balogun Street, the same street where Alade Police Division is located, beat and robbed its occupants. The robbers were then said to have moved to Anifowoshe Street, which is just behind the police station, attacking another house before shifting to Awoseyin Street.', 80, 265, '2012-11-02 22:40:42', 'Show');
