INSERT INTO `post` VALUES(764, 'K-Solo''s new fiancee shows off engagement ring:\r\nK-Solo has officially put a ring on it. Though he announced his engagement to Bimbo on October 24th, it wasn''t until last Friday that he gave her a ring. K-Solo dated Bimbo for about 7 years before he ended things with her to marry estranged wife, Kikelomo.', 80, 265, '2012-11-04 23:15:48', 'Show');
INSERT INTO `post` VALUES(765, 'We did not kill General Shuwa - Boko Haram:\r\nMajor General Mammam Shuwa, a former member of the Supreme Military Council, was shot dead at his home at Gwange in Maiduguri on Friday November 2nd. A guest who was at his home was also killed. Boko Haram was later blamed for the assassination. But the terrorist group today denied having a hand in Gen Shuwa''s death. A rep for the group said they held the general in high esteem as he never said anything against them and had no reason to kill him.', 80, 265, '2012-11-04 23:18:41', 'Show');
