INSERT INTO `post` VALUES(768, 'D''banj wins Best African Act at 2012 MOBO Awards:\r\nThe Kokomaster beat P-Square, Fally Ipupa, Sarkodie, Cabo Snoop, Camp Mulla, to win the 2012 MOBO Awards Best African Act of 2012. The awards held last nigh 3rd November at thhe Echo Arena, Liverpool, UK. Big congrats to him.\r\n\r\nMeanwhile, he has lost out of the MTV Europe Music Award Best Worldwide Act category.', 80, 265, '2012-11-04 23:23:00', 'Show');
INSERT INTO `post` VALUES(769, 'NCC Orders Telcoms To Provide Instant Call Bills To Consumers:\r\nThe Nigerian Communications Commission yesterday directed all mobile operators in Nigeria to send, free of charge, a message or an alert to both postpaid and prepaid subscribers after every call, SMS, or system generated charge or tariff, and also provide full details of the cost of each call, and available balances to the subscriber.', 80, 265, '2012-11-04 23:24:36', 'Show');
INSERT INTO `post` VALUES(770, 'Ayo Fayose escapes death, driver beaten mercilessly by hoodlums:\r\nFormer governor of Ekiti State, Ayo Fayose, yesterday Saturday November 3rd escaped an attack  from hoodlums who trailed his vehicle to Ilupeju-Ekiti in Oye Local Government Area of the state.\r\n\r\nFayose was not in the car, but his driver, Nathaniel Saliu, was. The driver later told newsmen that he was beaten mercilessly by the hoodlums numbering about four, who dragged him out of the car and asked him of his boss'' whereabouts. Saliu said he was attacked between Ilupeju and Ire at about 12 noon when he had to slow down at a bad portion of the road. He said they only left him after they were convinced that Fayose was not in the area. \r\n\r\nAccording to him, the hoodlums had planned to kill his boss if they had found him in the vehicle. The incident was reported at the Okeila Police Station in Ado-Ekiti.', 80, 265, '2012-11-04 23:25:38', 'Show');
INSERT INTO `post` VALUES(771, 'Does this hand sign mean anything?\r\nSome people freak out when they see celebs displaying this hand sign. (That''s Dencia and Mikel Obi above) Some say it''s the Illuminati sign. I have no idea what it is really, but I think that most of the people who display this hand sign don''t even know what it means...and I also think this Illuminati thing is being blown out of proportion. Not every Tom, Dick and Mariah can get into the organization, for those who believe in its existence...', 80, 265, '2012-11-04 23:28:00', 'Show');
INSERT INTO `post` VALUES(772, 'Osaze Odemwingie no longer wants to play for Nigeria?:\r\nHead coach of the Nigeria national team, Stephen Keshi has sensationally revealed to supersport.com that West Bromwich Albion star, Osaze Odemwingie wants out of the Super Eagles. \r\n\r\nOdemwingie last played for Nigeria in a 2013 Africa Cup of Nations qualifier against Rwanda on February 29 in Kigali. \r\n\r\n    Keshi has now revealed that he spoke to the WBA forward a week before Nigerias second leg final round 2013 Afcon qualifying game against Liberia on October 13 and that Odemwingie told him that he had decided not to play for Nigeria again.', 80, 265, '2012-11-04 23:29:38', 'Show');
INSERT INTO `post` VALUES(773, 'Rihanna''s topless morning after photo:\r\nThe singer posted this topless photo of herself on her Instagram page with the caption - ''The morning after! Hello November.'' The photo was taken the morning after a Halloween costume party she hosted in West Hollywood some days back, where she dressed as marijuana. For the morning after photo, Rihanna ditched the costume but kept on her green veil. See the full weed costume after the cut...', 80, 265, '2012-11-04 23:31:04', 'Show');
INSERT INTO `post` VALUES(774, 'Children of abandoned octogenarian sisters surface, relocate them:\r\nAt last, succour has come the way of Ibijoke Apena and Janet Eruwayo,  two octogenarian sisters abandoned by their children and relations, as some of their children surfaced on Saturday and relocated them.\r\n\r\nThe aged sisters were moved to a private old peoples home at Jakande Estate, Isolo, Lagos State.\r\n\r\nThe relocation was spearheaded by Apenas first child, Rotimi, a contractor in Abuja and two grandchildren, who craved anonymity.\r\n\r\nThe childrens action came on the heels of PUNCH Metros  expose on the deplorable state of the aged women last Friday.', 80, 265, '2012-11-04 23:32:47', 'Show');
INSERT INTO `post` VALUES(775, 'I am not Messis friend, says Ronaldo:\r\nCristiano Ronaldo says he has a strictly professional relationship with Lionel Messi and is not friends with the Argentina international.\r\n\r\nThe pair have been painted as fierce rivals in recent years, with both players competing for club and individual honours. Even though he admits they are not close, Ronaldo is adamant there are no issues between the two of them and expressed his respect for the Barcelona man.\r\n\r\nHe (Lionel Messi) is a great player, Ronaldo told beIN sport. I have a professional relationship (with him) like I have with other players. Im not friends with him, because we dont share the same dressing room. I respect him like a professional. Were not real friends, just friends through our profession.', 80, 265, '2012-11-04 23:34:02', 'Show');
