INSERT INTO `post` VALUES(777, 'FG planning to ban Postinor 2?:\r\nThere are rumours that the federal government is planning to ban birth control/morning after pill, Postinor 2, because of its side effects. (If you''re a user, Google to find out the side effects).\r\n\r\nThe purported ban is the number one trending topic on Twitter right now and trust Naijas, they know how to find trouble. Hehe! People started tweeting @2face Idibia about the ban and making jokes. He didn''t find it funny...lol', 80, 265, '2012-11-05 14:00:10', 'Show');
INSERT INTO `post` VALUES(778, 'Munachi Abii stunning in red as she turns 25:\r\nThe former beauty queen and rapper turns 25 today (November 5th).  Releasing two new pictures from her recent photoshoot in Atlanta USA, Muna continues to work hard as she forges ahead in her career, recording her debut album and expanding her brand home and abroad. Watch out for her website Munaworld.com set to go live in the new year. Happy Birthday Muna.', 80, 265, '2012-11-05 14:03:07', 'Show');
INSERT INTO `post` VALUES(779, 'Check out Jumobi Mofe Damijo''s breast tattoo:\r\nThe former TV presenter and mother of two is married to actor, Richard Mofe Damijo. She was photographed yesterday at Agatha Amata''s birthday shindig with that butterfly Tattoo on her right boob. Fierce!', 80, 265, '2012-11-05 14:05:27', 'Show');
INSERT INTO `post` VALUES(780, '6 Ph.D, 704 Masters Holders among applicants for drivers at Dangote:\r\nIn June 2012, the Dangote Transport company said they were looking to employ 2, 000 graduate drivers. A few of us thought it was NOT RIGHT for the company to insist on university graduates for that kind of job, but guess what? It wasn''t just graduates that applied for the Graduate Executive Truck Driver position o. Of the 13, 000 applications received, 6 were Ph.D holders, 704 were Masters Holders, while 8, 460 were Bachelor degree holders.\r\n\r\nThe Chairman of the company, Aliko Dangote revealed this while speaking during the mentor-ship meeting of the World Bank Youth Forum. Na wao! FG should do something about unemployment in this country.', 80, 265, '2012-11-05 14:07:01', 'Show');
INSERT INTO `post` VALUES(781, 'BZM members arrested after they declared independence &amp; flew a Biafran flag:\r\nAt least 100 members of the Biafra Zionist Movement were arrested in Enugu today after they declared independence and raised a Biafran flag during a march in the state.\r\n\r\nThe last time a Biafran flag was raised (1967), there was war in Nigeria. The men arrested today, young men and veterans of the war, have been charged with treason.\r\n\r\nThe Biafran Zionist Movement members first gathered yesterday to celebrate Ojukwu''s birthday, then marched through the streets again today supporting independence for Biafra. \r\n\r\nThe Biafran war has been put back in the spotlight by Chinua Achebe''s war memoir', 80, 265, '2012-11-05 14:07:43', 'Show');
INSERT INTO `post` VALUES(782, 'Professional ''cuddler'' makes $500 a day by inviting strangers to take a nap with her at home:\r\n29 year old Jackie Samuel is a professional cuddler. She charges up to $100 an hour to cuddle people who need cuddling. Lol. Oyibo people sef! Jackie Samuel established The Snuggery in Rochester, New York and makes up to $500 a day and cuddles up to 30 people, both men and women, a week.', 80, 265, '2012-11-05 14:11:59', 'Show');
INSERT INTO `post` VALUES(783, 'Dbanj to perform for an hour with live band at TOP10MICS:\r\nFresh off his 2012 MOBO Awards success where he was named Best African Act for his song, Oliver Twist, Dapo Oyebanjo popularly called Dbanj will perform at this years music concert, TOP10MICS for one hour with a live band as the concert holds at Eko Hotel and Suites, Victoria Island , Lagos on Friday, November 30, 2012.', 80, 265, '2012-11-05 14:12:46', 'Show');
