INSERT INTO `post` VALUES(786, 'Okada riders beat up LASTMA officers:\r\nAggrieved riders of motorcycles popularly called Okada plying Magodo area of Lagos State took to the Ojodu Berger road on Monday to engage some officers of the Lagos State Traffic and Management Authority in a fight after a raid by a combined team of policemen and LASTMA officers.', 80, 265, '2012-11-05 23:18:06', 'Show');
INSERT INTO `post` VALUES(787, 'Sambos helicopter destroys 78-year-old womans home:\r\nThe sand stirred up by the helicopter conveying Vice-President Namadi Sambo to Buanchor, Boki Local Government Area of Cross River State on Friday destroyed a mud-house belonging to a 78-year- old woman, Mrs. Bessie Obi, when it landed in the community.\r\n\r\nSambo was in the community to ascertain the extent of damage caused by recent landslide from surrounding mountains silting rivers, streams and causing flooding in the area.\r\n\r\nAs soon as the mud-house collapsed, Obi ran out and started crying profusely.', 80, 265, '2012-11-05 23:19:10', 'Show');
INSERT INTO `post` VALUES(788, 'African Footballer of the Year: Mikel makes Top-10 shortlist:\r\nJohn Mikel Obi has emerged as the only Nigerian shortlisted for the top ten of the 2012 African Footballer of the Year. :\r\nAlexander Song ( Barcelona and Cameroon)\r\nAndre Ayew (Marseille and Ghana)\r\nChristopher Katongo (Henan Construction and Zambia)\r\nDemba Ba (Newcastle United and Senegal)\r\nDidier Drogba (Shanghai Shenhua and Ivory Coast)\r\nGervinho (Arsenal and Ivory Coast)\r\nJohn Mikel Obi (Chelsea and Nigeria)\r\nPierre-Emerick Aubameyang (Saint Etienne and Gabon)\r\nYaya Toure (Manchester City and Ivory Coast)\r\nYounes Belhanda (Montpellier and Morocco)', 80, 265, '2012-11-05 23:20:41', 'Show');
