INSERT INTO `post` VALUES(805, 'FIFA rankings: Nigeria move six places up:\r\nNigeria have moved six places up from 63 to 57, according to the latest rankings released by world football body, FIFA, on Wednesday.\r\n\r\nThe upward move also impacted positively in Africa as the Super Eagles moved to 10th in the continent. Nigeria was previously rated 16th in Africa.\r\n\r\nThe Eagles have experienced a gradual renaissance under coach Stephen Keshi, who steered the team to Januarys Africa Cup of Nations. The Nigerian side defeated Liberia 8-3 aggregate in their final qualification game to book a ticket to South Africa.', 80, 265, '2012-11-08 01:09:46', 'Show');
INSERT INTO `post` VALUES(806, 'Four injured as trains collide in Lagos:\r\nMany passengers escaped death when two trains collided in Lagos on Wednesday.\r\n\r\nFour people were however injured.\r\n\r\nIt was learnt that the accident was due to the absence of signal operator at the Mushin Station terminus in Lagos.\r\n\r\nAn eyewitness, who identified herself simply as Bisi, said when one of the trains, which was coming from Ijoko in Ogun State got to the terminus, it stopped for passengers to disembark.', 80, 265, '2012-11-08 01:11:27', 'Show');
INSERT INTO `post` VALUES(807, 'Policeman kills bus conductor for stepping on him:\r\nA yet-to-be identified policeman attached to the Alapere Police Division, Ketu, Lagos, on Wednesday allegedly shot and killed a bus conductor for stepping on him.\r\n\r\nEyewitnesses said the policeman was standing at Tipper Bus Stop when the conductor stepped on him.\r\n\r\nThe eyewitness said, The policeman was in mufti. He challenged the man on why he stepped on him and could not apologise. I think the victim maintained that he was not going to apologise to him.\r\n\r\nIt happened so fast. All we heard was a gunshot and the conductor fell down bleeding profusely.\r\n\r\nOur correspondent learnt that people in the area immediately tried to swoop on the policeman but did not succeed as he threatened to shoot them.\r\n\r\nAccording to one of the eyewitnesses, the policeman also threatened to shoot a riot policeman who challenged him for shooting the conductor.', 80, 265, '2012-11-08 01:15:19', 'Show');
INSERT INTO `post` VALUES(808, 'Slain bridegroom: Five Lagos policemen arrested:\r\nFive policemen have been arrested in connection with the murder of 36-year-old Ugochukwu Ozuah, who was allegedly killed by policemen five days after his wedding.\r\n\r\nFollowing Ozuahs murder on September 20, 2012, the Inspector-General of Police, Mohammed Abubakar, constituted a team of 12 policemen attached to the Federal Criminal Investigation Department to investigate the case.\r\n\r\nIt was learnt that the team of policemen, headed by a deputy commissioner of police, Chris Ezike, arrived Lagos on September 30 and immediately began investigation from the crime scene at UPS Bus Stop, Oworonshoki Expressway.\r\n\r\nAccording to police source who craved anonymity, the policemen arrested are attached to the Anthony Division under whose jurisdiction the crime occurred.', 80, 265, '2012-11-08 01:17:19', 'Show');
INSERT INTO `post` VALUES(809, 'Police arrest brother of shot okada rider:\r\naiwo Atilola, mother of the 27-year-old commercial motorcycle rider, Adigun, who was allegedly shot by a policeman in Lagos on Tuesday said Adiguns brother, Sikiru, was also arrested after the incident.\r\n\r\nShe therefore appealed to the Lagos State Police Command to release her son so as to lessen her trauma.\r\n\r\nTaiwo said, We have been to the police station, but they have refused to grant his release. I was left in the dark as regards his arrest until last night (Tuesday) because they didnt want me to fall into a coma. He would have been the one doing the running around now that his brother is down.\r\n\r\nHe must have been mistaken for one of the protesters who went on the rampage. The police succeeded in injuring my son who is the one solely taking care of me. They should not add to my sorrow, they should please release him so that I wont develop sudden hypertension.', 80, 265, '2012-11-08 01:19:43', 'Show');
INSERT INTO `post` VALUES(810, 'PHCN official in attempted rape scandal:\r\nAn official of the Power Holding Company of Nigeria, Mr. O. S Babatunde, has been accused of attempting to rape ladies in Agunbelewo, Osogbo in Osun State while distributing electricity bills.\r\n\r\nIt was gathered that the bubble burst on Friday when Babatunde, attempted to rape a lady when he visited her house on Aderinola Street to distribute bills.\r\n\r\nThe lady raised the alarm and called on a lecturer, who lives in the neighbourhood.\r\n\r\nA resident, who spoke on condition of anonymity, said, The lady was in a terrible shock. She was shaking and speechless. When she eventually spoke, she narrated her ordeal in the hands of the PHCN official.\r\n\r\nInvestigation showed that the official was transferred from Ede Division of PHCN to Agunbelewo recently on account of his alleged misconduct.\r\n\r\nThe resident said, He (Babatunde) has a record of trying to sexually assault ladies while on duty. Three other ladies came up after he was arrested to testify against him; they said he had attempted to rape them too.\r\n\r\nIt was after he was arrested and detained by the police that he confessed to the crime.', 80, 265, '2012-11-08 01:21:12', 'Show');
INSERT INTO `post` VALUES(811, 'Mariah Carey releases Obama victory song:\r\nMariah Carey is marking Barack Obamas re-election with Bring It On Home, a new song, USA Today reports.\r\n\r\nCarey, who campaigned for Obama, tweeted on Tuesday, Congratulations to our beloved President Barack Obama, our spectacular First Lady Michelle Obama &amp; the adorable Malia &amp; Sasha. We love you!\r\n\r\nShe added she was moved by his victory words, tweeting, INCREDIBLE SPEECH!!!!!! Watching in a room full of diverse people-all truly moved. Thank you America for President Obama-4more yrs.\r\n\r\nJermaine Dupri then unveiled the song on his Global14 website and tweeted that he said Carey wrote specifically for Obama. Mariah promptly retweeted the news.', 80, 265, '2012-11-08 01:22:36', 'Show');
INSERT INTO `post` VALUES(812, 'Uche Jombo Rodriguez opens up on recent eye surgery:\r\nAs a child, I had an accident while playing with an iron hanger as a gun and it accidentally got into my right eye. I had surgery then abroad, at the age of 9. This new surgery is more of cleaning and keeping up to date with the best eye surgery, when it was found out that it wasn''t properly done the first time, and presently the doctors are correcting it', 80, 265, '2012-11-08 04:38:24', 'Show');
