INSERT INTO `post` VALUES(820, 'Davido not a threat Wizkid:\r\nA few years ago when rave of the moment, Wizkid dropped out of Lead City University in his second year, not a few thought he made the wrong decision.\r\n\r\nAlthough he chose to follow the music path, the artiste, whose real name is Ayo Balogun, does not underestimate the importance of education.', 80, 265, '2012-11-08 22:19:09', 'Show');
INSERT INTO `post` VALUES(821, 'Department store collapse in Ghana turns deadly :\r\n 5 people have been confirmed dead and 68 people pulled out alive from the multi-storey department store that collapsed in Ghana yesterday\r\n\r\nA spokeswoman for Ghana''s National Disaster Management Organization, said structural weakness had caused the collapse of the Melcom store in Accra''s Achimota neighbourhood which was opened early this year and collapsed shortly before the store was due to open for business yesterday morning. Over a 100 people were in the 5-storey complex when it collapsed suddenly.\r\n\r\nRescue efforts is still going on at the site as workers say that they can hear noises from under the rubble and can see hands of people trapped. Sad!', 80, 265, '2012-11-08 22:21:22', 'Show');
