INSERT INTO `post` VALUES(823, 'Aftermath of Aluu4 killings - UNIPORT reopens :\r\nUniversity of Port Harcourt, which was shut down on October 9th following protest by students over the brutally killing of four of their school mates in Aluu community, has finally re-opened. School Authorities today announced the re-opening of the institution and asked all students to return to campus as academic activities will begin Monday November 12th.\r\n\r\nIn three words I can sum up everything I''ve learned about life: It Goes On! So live your best life!', 80, 265, '2012-11-08 22:24:26', 'Show');
