INSERT INTO `post` VALUES(835, 'Frank Edoho secretly re-marries?:\r\nI put a question mark there because I don''t know for sure if they are married but the Who Wants To Be A Millionaire host recently introduced Sandra Onyenaucheya as his wife. Not girlfriend or fiancee, as wife. He told guests at the unveiling of the new Heineken bottle which held at the Federal Palace hotel some days back, that he came to the event with his wife, Sandra, who was wearing a wedding band.\r\n\r\nThe couple went public last year after Frank Edoho ended his marriage with mother of his three children, TV gal, Katherine Edoho. Sandra, a mother of one, moved into Frank''s VGC home sometime last year and there were reports that they planned to marry soon. Guess the deed has been done! Congrats to them!', 80, 265, '2012-11-09 22:59:47', 'Show');
