INSERT INTO `post` VALUES(839, 'Spider-Man''s Emma Stone and Andrew Garfield Do Low-Key Lunch in Santa Barbara:\r\nThese two sure make a cute couple.\r\n\r\nEmma Stone and Andrew Garfield had a casual daytime date in Santa Barbara, Calif. on Thursday. Wearing jeans and fall coats, the Amazing Spider-Man costars enjoyed lunch at the famed La Super-Rica Taqueria, a tasty, no-frills spot championed by the late Julia Child among others.\r\n\r\nAware of the presence of cameras, Emma and Andrew joked with photogs not to take photos of them while they were eating.\r\n\r\nWe''re sure they looked cute then, too.', 80, 265, '2012-11-09 23:16:26', 'Show');
