INSERT INTO `post` VALUES(845, 'Oritsejafor gets jet as birthday gift:\r\nThe President of the Christian Association of Nigeria and founder of Warri-based Word of Life Bible Church, Pastor Ayo Oritsejafor, on Saturday joined the league of Nigerian preachers who own private jets.\r\n\r\nOritsejafors jet, marked N431CB, was announced to the congregation during the 40th year anniversary of the church, which coincided with his birthday held on the church premises in Warri, Delta State.\r\n\r\nThe announcement of the 10-Seater Bombadier/Challenger 601 Aircraft elicited a loud ovation and applause from the congregation.', 80, 265, '2012-11-11 02:43:36', 'Show');
