INSERT INTO `post` VALUES(917, 'Former Ikeja council Chairman, Toyin Hamzat, assasinated :\r\nFormer chairman of Ikeja LGA and and special adviser in the Lagos Ministry of Health, Toyin Hamzat, was shot dead around 9 last night along the Sagamu Expressway, Ogun State while returning from his home in Aiyepe in Ogun State.\r\n\r\nThe police believe it was an assassination and not robbery because the gunmen didn''t take anything from the scene of the incident. Five men have so far been arrested in connection with the murder.', 80, 265, '2012-11-19 12:42:29', 'Show');
INSERT INTO `post` VALUES(918, 'Soldier filmed colleagues killing captives in Maiduguri  Report:\r\nternational news agency, REUTERS,  on Sunday reported  that it was in possession of an amateur video showing Nigerian soldiers shooting unarmed captives in broad daylight in Maiduguri,  Borno State.\r\n\r\nIt said the video was sent to it by a soldier,  who claimed to have witnessed the shooting. Reuters quoted the unnamed soldiers as saying that he was present when the soldiers shot the captives about two weeks ago.\r\n\r\nMaiduguri is the seat of the violent Islamic sect, Boko Haram, and there have been many clashes between military operatives and the sect members.', 80, 265, '2012-11-19 12:50:34', 'Show');
