INSERT INTO `post` VALUES(954, 'Mohamed Morsi bars court challenges and orders Hosni Mubarak retrial:\nEgypt''s president, Mohamed Morsi, has granted himself far-reaching powers and immunity from legal oversight as he ordered the retrial of his predecessor Hosni Mubarak over the killing of protesters during the country''s revolution.\n\nIn a surprise move, Morsi, the Muslim Brotherhood leader who was instrumental in securing a ceasefire between Israel and Hamas on Wednesday, issued a series of measures preventing Egypt''s courts from challenging any laws or decrees passed since he assumed office in June.', 80, 265, '2012-11-22 22:17:04', 'Show');
INSERT INTO `post` VALUES(955, 'J Martins wins GIAMA award:\nJ Martins has been honoured with a Golden Icon Academy Movie Award (GIAMA) for his achievements in the African music industry. The musician and producer was presented with the African Music Ambassador award at the recent ceremony held in Houston, USA.\n\nThe annual award show was created to celebrate Africa''s rich entertainment culture, as well as to honour excellence and creativity in the Nigerian entertainment industry.', 80, 265, '2012-11-22 22:18:49', 'Show');
INSERT INTO `post` VALUES(956, 'Spoek Mathambo compilation album:\nSpoek Mathambo is set to release his compilation album, ''Spoek Mathambo: Future Sound Of Mzansi'', on 26 November. The fifteen track album will include new tracks and unreleased remixes.\n\nThe rapper, producer and singer has also just returned from a UK Tour and a production collaboration with British musician/actor Damon Albarn, of Blur and Gorillaz.', 80, 265, '2012-11-22 22:27:53', 'Show');
INSERT INTO `post` VALUES(957, 'We Need More Money for Food at Aso Rock Presidency tells Senate that N1.3billion for Refreshment &amp; Meals is Insufficient:\nWhen President Goodluck Jonathan presented the 2013 budget, it was followed by an outrage over the large amount of money allocated to refreshment, meals and  other miscellaneous expenses in the State House. Nigerians complained that the money allocated for such expenses was too much and requested that it be cut down.\n\nEvidently, the Presidency did not heed to this outcry. On Wednesday 21st November, 2012, the Presidency asked the Senate to increase the N1, 305, 292, 050 set aside in the 2013 budget for refreshment and meals and other miscellaneous expenses in the State House.\n\nA breakdown of the Miscellaneous sub-head in the Presidential Villas budget shows that N203,752,432 was allocated for refreshment and meals; N107,412,768 would be spent on honorarium and sitting allowance while N37, 277,825 will be for publicity and advertisement.', 80, 265, '2012-11-22 22:29:55', 'Show');
INSERT INTO `post` VALUES(958, 'Police apprehend woman-led robbery gang:\nPolice in Ukanafun Local Government Area of Akwa Ibom State have apprehended a woman-led robbery gang.\n\nThe robbery gang, it was learnt, specialised in robbing their victims of cars, motorcycles and valuable items.\n\nThe operation was carried out by combined teams from Ukanafun Police Division and Rivers State Police Command, according to the state Police Public Relations Officer, Mr. Etim Dickson, on Thursday.\n\nDickson said the three-person robbery gang (made up of two men and a woman) was arrested at a black spot in Okoyo along Ukanafun-Azumini Road.\n\n The police acted on a tip-off and arrested the suspects at the black spot which they used as their operational base.\n\nOne of those arrested, Ubong Dickson, an indigene of Okoyo community, served as a linkman to other members of the gang. Ubong is said to have admitted to taking part in crimes.\n\nDickson stated that the arrest of the bandits was a step forward in the police quest to rid the state of all forms of crimes, especially as the Christmas and New Year periods were approaching.', 80, 265, '2012-11-22 22:33:02', 'Show');
INSERT INTO `post` VALUES(959, 'We foiled terror attack through inter-agency effort  Ihejirika:\nChief of Army Staff, Lt. Gen. Azubuike Ihejirika, has said inter-agency collaboration helped security agencies to foil a terror attack in the country recently.\n\nThe COAS, who stated that the Joint Task Force thwarted the planned attack, did not, however, elaborate on the incident.\n\nSpeaking during a visit to the Inspector-General of Police, Mohammed Abubakar, at Force Headquarters, Abuja, on Thursday, Ihejirika linked the successful operations against terrorists to the collaboration among security agencies in the country.\n\nHe said, Within the last one week, we have recovered nothing less than 30 assorted weapons and we have recovered money  hidden in the engine  compartment of vehicles by these terrorists.\n\nWe have recovered vehicles prepared for bombing and attacks. So I want to tell you that the military and police are very professional.', 80, 265, '2012-11-22 22:34:37', 'Show');
INSERT INTO `post` VALUES(960, 'Racism: Referee cleared, Mikel charged:\nThe Football Association has cleared referee Mark Clattenburg of using inappropriate language towards Chelsea midfielder John Obi Mikel.\n\nBut Mikel, 25, has been charged by the FA with misconduct following his involvement in the incident.\n\nThe Blues had claimed Clattenburg directed racial language at Mikel in their home defeat by Manchester United.\n\nClattenburg said it was truly frightening to have faced the prospect that his career might be over.\n\nFollowing the match at Stamford Bridge on October 28, the FA interviewed Clattenburg, Mikel and several other Blues players before reaching its decision to clear the official and charge the Nigerian.\n\nIt is alleged that in or around the match officials changing room at the end of the fixture, Mikel used threatening and/or abusive and/or insulting words and/or behaviour, an FA statement read.\n\nMikel has until Friday, 30 November to respond. Chelsea have indicated he will not deny the charge but will request a hearing to explain the mitigating circumstances.', 80, 265, '2012-11-22 22:45:38', 'Show');
INSERT INTO `post` VALUES(961, 'Gabriel K-Fraudy Aubry And Olivier Martinez Hospitalized After Bone-Breaking Brawl At Halle Berrys Crib!!:\nGabriel Aubry was arrested Thanksgiving morning after a melee at Halle Berrys house, which sent both Gabriel and Halles fiance Olivier Martinez to the hospital  TMZ has learned.\n\nLaw enforcement sources tell TMZ  Gabriel showed up at Halles doorstep with Nahla for a custodial hand-off. Were told Gabriel was inside the house when Olivier walked up to him and said, We have to move on. \n\nAccording to witnesses, Gabriel then pushed Olivier and threw a punch at his face, but Olivier blocked it and the punch struck him in the shoulder instead. Were told Gabriel then pushed Olivier to the ground, and Olivier cold-cocked him in the face, and a struggle ensued, ending with Olivier pinning Gabriel to the ground.\n\nIn the struggle, Gabriel suffered a broken rib, contusions on his face, and possibly a more serious head injury. Olivier may have broken his hand and suffered neck injuries as well. There are conflicting accounts as to whether Gabriel was rendered unconscious in the fight.', 80, 265, '2012-11-22 22:48:10', 'Show');
INSERT INTO `post` VALUES(962, 'Justin Bieber Not Charged in Altercation With Photographer:\nJustin Bieber will not face charges for his altercation with a photographer earlier this year, according to court documents.\n\nOn May 27, Bieber and his then-and-possibly-still-girlfriend Selena Gomez were leaving the movie theater at the Commons at Calabasas shopping center. As usual with this pair, several paparazzi were present, photographing them walking to their van, and then driving awayor trying to. Apparently, Bieber thought that the paps were blocking their way out, because, according to court documents, he exited the van and confronted one of them.\n\nWhat happened next? Well, photographer Jose Hernandez-Duran later told Los Angeles County Sheriff''s deputies that Bieber kicked him in the gut and punched him in the facea claim that deputies investigated. In a charge evaluation worksheet filed on Oct. 22, the L.A. County District Attorney''s Office detailed the many ways in which they were unable to corroborate that accusation.', 80, 265, '2012-11-22 22:49:37', 'Show');
