INSERT INTO `post` VALUES(965, 'FIFA dashes Drogbas hopes:\nDidier Drogbas hopes of an immediate move to a European club from Shanghai Shenhua have been dashed by FIFA.\n\nThe Ivorian striker was being linked with a loan move to former club Chelsea after the Chinese Super League ended this month.\n\nThe 34-year-old requested special permission to join another club outside of the international transfer window to maintain his fitness levels ahead of the African Cup of Nations, which starts on January 19 in South Africa.\n\nHowever, FIFA upheld its rules in previous cases when making Major League Soccer players David Beckham, Thierry Henry and Landon Donovan wait until January to make loan moves.\n\nDrogba has insisted that the African tournament remains a priority.', 80, 265, '2012-11-22 22:54:09', 'Show');
INSERT INTO `post` VALUES(966, 'Eko 2012: Abdullahi hails Lagos over sports development:\nMinister of Sports/ Chairman, National Sports Commission, Bolaji Abdullahi, has commended Lagos State for its commitment to sports development, saying he was eager to watch the kick-off of the 18th National Sports Festival tagged Eko 2012.\n\nThe minister, who spoke during the one-day seminar organised by the Local Organising Committee of the festival, urged other states to take a cue from Lagos.\n\nI want to commend Lagos State for abiding with the commitment to the development of sports in Nigeria. A couple of other states are also doing the same, Abdullahi said.', 80, 265, '2012-11-22 22:55:33', 'Show');
