INSERT INTO `post` VALUES(973, 'Ashanti joins Keyshia cole in New York:\nKeyshia Cole celebrated the release of her new album Woman to Woman with a show at the Best Buy Theater in New York City last week. The Oakland-based singer surprised fans by bringing Ashanti out to perform the title track off the new album. Cole recently told the Los Angeles Times that she is planning a Woman to Woman Tour, which will launch in early 2013. She is hoping to have Brandy and Melanie Fiona join her on the outing.', 80, 265, '2012-11-23 13:05:40', 'Show');
