INSERT INTO `post` VALUES(976, 'A Braided Up And Bare-Faced Bey Shows Off Little Baby Baller Blue Ivy:\nThe Knowles-Carter clan may have taken the day off for Thanksgiving, but that doesnt mean King Bey isnt keeping up with her new found Instagram fetish.\n\nThe blonde-haired mommy banger recently showed off a few personal candids of herself and her hubby Hov enjoying parenthood with their growing lil bushy-haired bundle Blue Ivy, while her sister Solange flashed flicks in Mexico City with her son Juelz.\n\nWere not sure what the deal is with those throwback Destinys Child box braid cornrows.smh.', 80, 265, '2012-11-24 09:14:46', 'Show');
