INSERT INTO `post` VALUES(978, 'Arafat to be exhumed on Tuesday over poisoning claim:\nThe body of Palestinian leader Yasser Arafat is to be exhumed on Tuesday, Palestinian officials say.\n\nHis body is to undergo tests to find out whether his death in Paris in 2004 was caused by poisoning.\n\nArafat''s medical records say he had a stroke resulting from a blood disorder.\n\nBut France began a murder inquiry in August after Swiss experts hired by a documentary crew found radioactive polonium-210 on Arafat''s personal effects.', 80, 265, '2012-11-24 09:30:22', 'Show');
INSERT INTO `post` VALUES(979, 'Harry Redknapp takes over as manager:\nQueens Park Rangers have appointed Harry Redknapp as manager on a two-and-a-half year contract. \n\nThe 65-year-old will watch his new team from the stands when Rangers play Manchester United at Old Trafford in the Premier League on Saturday. \n\nRedknapp told QPR''s website: ', 80, 265, '2012-11-24 09:37:37', 'Show');
INSERT INTO `post` VALUES(980, 'Funke Akindele diagnosed with cancer in new film:\nStar actress, Funke Akindeles role in a new movie entitled, A Wish may bring most viewers close to shedding tears. This is a warning to fans warming up to attend the premiere of the film in Lagos soon.\n\nStraight from the stable of Elvis Chucks, the hilarious comedy features other Nollywood notables, such as Patience Ozokwor, Hafiz Oyetoro, Helen Paul, Chris Okagbue, Bishop Imeh and Kola Olaiya, among others.\n\nThe movie tells the story of a single mother, an uneducated petty trader, whose greatest wish is to see her child go to school and explore the opportunities that she never had. But fate deals her a numbing blow as her daughter is diagnosed with cancer.\n\nFunke plays the part of the doomed daughter, Kemi. She falls in love with a man who jilts her as soon as he learns that she is afflicted with a terminal disease.\n\nThe film will tour the cinemas from Dec. 7.', 80, 265, '2012-11-24 09:38:47', 'Show');
