INSERT INTO `post` VALUES(994, 'Ferguson hails Manchester United''s ''10-minute heroes'':\nWhile most eyes were focused on Harry Redknapp''s return to Premier League management with Queens Park Rangers on Saturday, it was two of Manchester United''s unsung heroes who grabbed the spotlight.\n\nWith former Tottenham boss Redknapp watching from the stands after being confirmed as Mark Hughes'' replacement, it appeared the English top flight''s only winless team might pull off a major upset after taking the lead at Old Trafford.\n\nHowever, second-half substitute Anderson inspired yet another comeback by Alex Ferguson''s side as United returned to the top of the table with a 3-1 victory and bounced back from last weekend''s shock defeat by Norwich.\n\n', 80, 265, '2012-11-25 01:37:48', 'Show');
INSERT INTO `post` VALUES(995, 'Dhaka Bangladesh clothes factory fire kills more than 100:\nFirefighters took several hours to bring the fire under control.More than 100 people are now known to have died in a fire that swept through a clothes factory in Bangladesh, local officials say.\n\nThe blaze broke out late on Saturday in the multi-floor Tazreen Fashion factory in the Ashulia district on the outskirts of the capital Dhaka.\n\nSome people died after jumping from the building to escape the flames. \n\nIt is unclear what caused the fire, which started on the ground floor trapping many victims in the factory.\n\nFirefighters managed to contain the blaze on Sunday morning, and officials suspect an electrical short circuit might have caused the disaster.', 80, 265, '2012-11-25 01:39:48', 'Show');
