INSERT INTO `post` VALUES(997, 'Ricky Hatton retires after Vyacheslav Senchenko defeat:\nFormer two-weight world champion Ricky Hatton has announced his retirement from boxing following his loss to Vyacheslav Senchenko in Manchester. \n\nHatton, 34, had not fought since 2009, but his return to the ring on Saturday ended with a ninth-round stoppage.', 80, 265, '2012-11-25 01:58:17', 'Show');
INSERT INTO `post` VALUES(998, 'World''s most expensive parking places:\nNestled within Hong Kong''s dense skyscraper jungle, a $640,000 property sits among some of the world''s most expensive commercial and residential spaces.\nThe price might sound like a steal. This Asian financial capital has the world''s priciest property, according to Savills. Since the start of 2010, average Hong Kong home prices have doubled.\nBut the price tag mentioned here is neither for a home nor an office.\n\nIt is for a parking space: A slab of undecorated concrete, stained by black motor oil, about 8-feet-by-16-feet in size. Price per square foot: nearly $5,000.\n\nJacinto Tong has owned and used this space for the past ten years. Described in local media as ', 80, 265, '2012-11-25 02:02:16', 'Show');
