INSERT INTO `post` VALUES(1000, 'FG charges varsities with standards:\nPresident Goodluck Jonathan, on Saturday, asked universities to maintain standards that would promote the growth of education in Nigeria.\n\nSpeaking at the 38th graduation/42nd Founders Day anniversary of the University of Benin, Edo State, Jonathan called on vice-chancellors to key into governments transformation agenda in tackling challenges confronting the country, including those in the area of crime prevention and environmental degradation.\n\nSpeaking through the Minister of Education, Prof. Ruquayattu Rufai, who was also represented by Prof. Patrick Onolememen, Jonathan commended the institution for maintaining its ranking as the best in Nigeria.', 80, 265, '2012-11-25 02:04:59', 'Show');
INSERT INTO `post` VALUES(1001, 'N5tn stolen under Jonathan Investigation:\nOver N5tn in government funds have been stolen through fraud, embezzlement and theft since President Goodluck Jonathan assumed office on May 6, 2010, a SUNDAY PUNCH investigation has found.\n\nOur correspondents arrived at the stolen sum after poring over the reports of the various committees set up by the President to probe some sectors of the economy, particularly oil and gas. SUNDAY PUNCH also relied on disclosures by some senior government officials.(PUNCH)', 80, 265, '2012-11-25 02:06:46', 'Show');
