INSERT INTO `post` VALUES(1004, 'More reports have emerged from the Command and Staff College where bomb blasts killed scores of worshippers earlier today at St Andrews Protestant Church,Jaji .\r\n\r\nA correspondent in Kaduna described the attacks as a twin blast by suspected suicide bomber (s?).A bomb went off and as worshippers struggled to get out another explosion also occurred ,the correspondent relying on Jaji insiders said.\r\n\r\nIt was learnt that more than 50 worshippers may have been killed by the twin blasts today .But the identities of those killed could not be determined immediately.\r\n\r\nOfficial statement were still being awaited as at the time of writing this report.But a resident of Kaduna who travelled between Zaria and Kaduna yesterday wondered how any suicide bomber could have infiltrated the security at Jaji.\r\n\r\nI travelled along the road yesterday and it took us more than one and a half hours to go through the security checks along the road.So how could a suicide bomber have infiltrated there?I just wonder the man said.', 80, 265, '2012-11-25 08:23:01', 'Show');
