INSERT INTO `post` VALUES(1009, 'Benitez booed by fans as Chelsea fail to sparkle:\nRafael Benitezs reign at Chelsea got off to a negative start, with the new manager being booed by the crowd at Stamford Bridge during his first game in charge as the Blues drew 0-0 with Manchester City on Sunday.\n\nThe former Liverpool boss replaced Roberto Di Matteo at the helm last week after the Italian was dismissed for a run of just two wins in eight, but Benitez arrival in west London was met with dismay by the Blues fans.', 80, 265, '2012-11-25 23:11:26', 'Show');
INSERT INTO `post` VALUES(1010, 'Newspaper vendor murdered for turning down free reader:\nA newspaper vendor in Calabar, Cross River State, Mr. Innocent Monday-Francis, was on Thursday murdered after an argument that followed his refusal to allow one of his neighbours, identified as Eno, to read the papers.\n\nMonday-Francis (22), who sold newspapers around the popular Flour Mill junction, along the Murtala Mohammed Highway in Calabar, had retired to a neighbourhood bar at Ikot-Effanga area of Calabar to take a bottle of drink when the incident occurred.', 80, 265, '2012-11-25 23:13:34', 'Show');
