INSERT INTO `post` VALUES(1020, 'Manchester City striker Carlos Tevez banned from driving:\r\nManchester City footballer Carlos Tevez has been banned from driving for failing to provide information when he was stopped for speeding in Lancashire.\r\n\r\nThe Premier League striker was stopped by police for breaking the speed limit in Morecambe on 28 March.\r\n\r\nHe had been in the town playing in a reserve team game.\r\n\r\nTevez, from Prestbury in Cheshire, was given an interim ban by Lancaster magistrates. He will have the length of his suspension set in December.', 80, 265, '2012-11-27 01:40:36', 'Show');
