INSERT INTO `post` VALUES(1042, 'Messi, C Ronaldo &amp; Iniesta nominated for 2012 Fifa Ballon d''Or:\r\nFIFA has revealed the names of the three players who remain in the race to win the World Footballer of the Year award 2012. They are Andres Iniesta (Spain, FC Barcelona), Lionel Messi (Argentina/FC Barcelona) and Cristiano Ronaldo (Portugal/Read Madrid)\r\n\r\nThe winner will be revealed at the FIFA Ballon dOr gala as part of a televised show at the Zurich Kongresshaus on 7 January 2013. Who do you think should win this year?', 80, 265, '2012-11-29 14:06:11', 'Show');
INSERT INTO `post` VALUES(1043, 'Actress Mosun Fillani gives birth to baby girl:\r\nThe popular Yoruba actress gave birth to a baby girl yesterday at a hospital in Lagos. Mum and child are said to be doing great.\r\n\r\nMosunmola married the son of a former police chief and Niger State Military administrator, Simeon Oduoye, early this year', 80, 265, '2012-11-29 14:11:02', 'Show');
INSERT INTO `post` VALUES(1044, 'University of Lagos ranked 9th best Univeristy in Africa :\r\nAccording to a new ranking released by Africa.com, University of Lagos is the 9th best University in Africa. Cairo University is the still the best University in Africa.\r\n\r\nSee the top 10 best Universities in Africa below...\r\n1. Cairo University  Egypt\r\n2. American University in Cairo  Egypt\r\n3. Mansoura University  Egypt\r\n4. Makerere University  Uganda\r\n5. University of Nairobi  Kenya\r\n6. University of Dar es Salaam  Tanzania\r\n7. University of Botswana  Botswana\r\n8. University of Ghana  Ghana\r\n9. University of Lagos  Nigeria\r\n10. Ashesi University  Ghana', 80, 265, '2012-11-29 14:13:11', 'Show');
INSERT INTO `post` VALUES(1045, 'David Beckham set to begin talks with AS Monaco:\r\nDavid Beckham is set to begin talks with French side AS Monaco, with negotiations expected to take place after Saturday''s MLS Cup final.\r\nThe 37-year-old is understood to be open to a move, having announced his desire to leave Los Angeles Galaxy.\r\nMonaco chief executive officer Tor-Kristian Karlsen told BBC Sport: ', 80, 265, '2012-11-29 14:45:36', 'Show');
INSERT INTO `post` VALUES(1046, 'General Buhari loses first daughter:\nThe first daughter of former Head of State and national leader of Congress for Progressive Change (CPC) Gen. Muhammad Buhari (rtd), has died.\n\nZulai Buhari died this evening in a hospital in Kaduna just two days after giving birth to a daughter. She was 40. She is survived by  her husband, Captain Mahmud Junaid and three children, including the new born baby who is said to be healthy and doing well.\n\nZulai will be put to rest later this night in Kaduna according to Islamic rights.', 80, 265, '2012-11-29 22:45:16', 'Show');
INSERT INTO `post` VALUES(1047, 'Fausat Balogun buried in Brazil:\nWondering who Fausat Balogun is or was in this case? Well, she''s the 72 year old woman who was arrested in Brazil for carrying drugs .Unfortunately she passed away on the 30th of October, 2012 due to a mild stroke caused by the high blood pressure which she''d been suffering from before arriving at the penitentiary. She died at the hospital for women inside the penitentiary in Brazil.\n\nNo family member came for her body so she was buried at the Vila Formosa Municipal Graveyard in Sao Paulo, Brazil.\n\nThe trip to Brazil was actually her first time out of Nigeria, and some heartless people decided to use her as a drug courier without her knowledge. She died in that country and was buried there. Truly sad!', 80, 265, '2012-11-29 22:47:19', 'Show');
INSERT INTO `post` VALUES(1048, 'Egypt power struggle: Assembly adopts new constitution:\nEgypt''s Islamist-run assembly has backed a draft constitution, including a measure keeping sharia, or Islamic law, as the main source of legislation.\n\nThe draft will now be sent to President Mohammed Morsi, who is expected to call a referendum on the issue.\n\nThe move comes after the constitutional court said it would rule on Sunday whether to dissolve the assembly.\n\nEgypt''s judiciary is in a stand-off with the president after he granted himself sweeping new powers.\n\nMr Morsi says his decree should only apply for as short a time as possible.\n\nLiberal, left-wing and Christian members of the constitutional assembly boycotted the vote, accusing the Islamists of trying to impose their vision.', 80, 265, '2012-11-29 22:49:00', 'Show');
INSERT INTO `post` VALUES(1049, 'Luiz Felipe Scolari returns as Brazil coach for 2014 World Cup:\nLuiz Felipe Scolari has been appointed as Brazil manager for a second time. \n\nThe former Chelsea and Portugal boss led Brazil to the 2002 World Cup title in Japan and South Korea. \n\nScolari, 64, replaces Mano Menezes, who was dismissed last week, and will now lead his country into the 2014 World Cup on home soil. \n\nCarlos Alberto Parreira has been named as technical director. Scolari''s first game in charge is scheduled to be a friendly away to England in February.', 80, 265, '2012-11-29 22:51:01', 'Show');
INSERT INTO `post` VALUES(1050, 'Mario Balotelli: Manchester City boss Mancini has no plans to sell:\nManchester City boss Roberto Mancini insists he has no plans to sell Mario Balotelli after the Italian striker scored in the 2-0 win over Wigan. \n\nBalotelli was linked with a move back to Serie A after being dropped earlier this season, but he marked his return to the side by putting City ahead. \n\nWhen asked if he might sell Balotelli in January, Mancini replied ', 80, 265, '2012-11-29 22:52:38', 'Show');
INSERT INTO `post` VALUES(1051, 'THE military has commenced the mass eviction of civilians from barracks across the country, Chief of Army Staff, Lt.-Gen. Azubuike Ihejirika, said on Thursday.\n\nThe eviction of non-soldiers from  barracks is coming on the heels of two successful attacks  by suspected terrorists in the first two days of this week.\n\nTwo car bombers had on Sunday struck at the St. Andrew Military Protestant Church inside the prestigious Armed Forces Command and Staff College,  in Jaji, near Kaduna. The college  houses the officers and men of the Infantry Centre and School as well as  the Nigerian Army Peace Keeping Centre .', 80, 265, '2012-11-29 23:00:39', 'Show');
