INSERT INTO `post` VALUES(1057, 'Court reads Ojukwus Will, Bianca takes lion share, new daughter revealed:\r\nThe will of the late Ikemba Nnewi, Chief Chukwuemeka Odumegwu-Ojukwu, was on Friday presented to the family with his widow, Bianca, getting the lions share.\r\n\r\nThe presentation by the Chief Registrar of the Enugu High Court, Mr Dennis Ekoh, was witnessed by Bianca, Mr Val Nwosu, Ojukwus first cousin, and Mr Mike Ejemba.\r\n\r\nIn the will, the late Ojukwu identified one Tenny Haman as one of his children. Ojukwu listed the children as Tenny Haman, Chukwuemeka Jnr, Mmegha, Okigbo, Ebele, Chineme, Afam and Nwachukwu.', 80, 265, '2012-11-30 23:02:20', 'Show');
