INSERT INTO `post` VALUES(1059, 'Governor Suntais aides return to Nigeria after treatment in Germany:\r\nThe Chief Security Officer and the Chief Details of Governor Danbaba Suntai of Taraba state have arrived Nigeria after successfully undergoing medical treatment in Germany following the October 25th plane crash. Governor Suntai and three of his aids sustained serious injuries in the plane crash and had to be flown abroad for urgent medical attention.', 80, 265, '2012-11-30 23:04:47', 'Show');
