INSERT INTO `post` VALUES(1062, 'Obasanjos call for revolution:\r\nDuring a recent conference on youth employment in Dakar, Senegal, former President Olusegun Obasanjo shocked his audience by openly calling for a revolution in Nigeria.\r\n\r\nAlso, it will be recalled that the former President called Nigerians to come out en masse for a Nigerian type Arab spring (revolution) during a workshop on economic diversification and revenue generation in December 2011 at the June 12 Cultural Centre in Abeokuta, Ogun State.\r\n\r\nObasanjos call was hinged on the prevailing high rate of youth unemployment, which he estimated to be about 72 per cent. If the audience in Dakar was shocked, then the residents of Warri in Delta State were utterly astonished when he commented on President Goodluck Jonathans handling of the crisis in the North.(PUNCH)', 80, 265, '2012-11-30 23:25:18', 'Show');
INSERT INTO `post` VALUES(1063, 'David Beckham braced for final MLS game for LA Galaxy:\r\nDavid Beckham will make his final appearance for LA Galaxy in the Major League Soccer final on Saturday.\r\nIt is a repeat of last year''s final, when Landon Donovan''s solitary goal gave Galaxy the victory.\r\nBut the build-up to this season''s showpiece event has been overshadowed by the former Manchester United man''s decision to quit the California club.', 80, 265, '2012-11-30 23:41:24', 'Show');
INSERT INTO `post` VALUES(1064, 'BBC African Footballer of the Year 2012 shortlist revealed:\r\nThe five candidates for the BBC African Footballer of the Year 2012 award have been revealed.\r\nYaya Toure has made the shortlist for the second consecutive year and he is joined by his Ivory Coast team-mate Didier Drogba, Senegal''s Demba Ba, Morocco''s Younes Belhanda and Zambia skipper Christopher Katongo.\r\nThe winner will be decided by African football fans, who have until 1830 GMT on Thursday, 13 December to vote for their choice.', 80, 265, '2012-11-30 23:53:33', 'Show');
