INSERT INTO `post` VALUES(1074, 'Graeme McDowell cruises to World Challenge win in California:\r\nGraeme McDowell was a model of consistency as he picked up his second World Challenge title in three years. \r\n\r\nThe Northern Irishman won this event at Sherwood Country Club in California in 2010 - the same year as his famous victory in the US Open - and the 33-year-old never seemed likely to give up his two-shot overnight lead on Sunday. \r\n\r\nHe completed a four-under par final round of 68 to finish 17 under overall. \r\n\r\nAmerican Keegan Bradley (69) finished in second place, three shots behind. \r\n\r\nDefending champion Tiger Woods was there or thereabouts for most of the week but, despite producing the occasional flash of his trademark brilliance, never really sustained a concerted challenge.', 80, 265, '2012-12-02 23:32:57', 'Show');
