INSERT INTO `post` VALUES(1076, 'Bishop Oyedepo asked to pay N2 billion over kindergartens death:\r\nThe General Overseer of Winners Chapel, Bishop David Oyedepo has been asked to pay N2 billion within 14 days as general damages or face legal action, for the death of three-year-old Imienfan Omokaro who got drowned at Kingdom Heritage Model School operated by Winners Chapel in Benin.\r\n\r\nA letter written by Omokaros Counsel, Prince Peter E. Uwadiae-Igbinigie and, dated November 28, 2012 and made available to journalists in Benin, explained that the amount was for the callous and senseless killing of our clients daughter, Miss Imienfan Omokaro.\r\n\r\n\r\nBesides, Mr. Omokaros lawyers want Kingdom Heritage Model School to tender unreserved apology in three national newspapers, warning that if the demands were not met within 14 days, we have the irrevocable instructions of our client to commence legal action against the school (Kingdom Heritage Model School) and Church (Winners Chapel) without any further correspondence from this Chambers.\r\n\r\nImienfan Omokaro, a KG I pupil of Kingdom Heritage Model School, was said to have drowned in a drum of water in a toilet in the school on November 1, 2012.\r\n\r\nAlso, teachers of the school allegedly did not inform her mother when she came to pick her from school on that fateful day until late in the evening. \r\n\r\nThe school authorities and Winners Chapel had reportedly kept the girl for more than an hour, praying for her before finally taking her to Irowa Hospital in Benin, where she was confirmed dead.\r\nThe girl had died before being brought to hospital, doctors said.', 80, 265, '2012-12-02 23:36:11', 'Show');
INSERT INTO `post` VALUES(1077, 'Loya Milk unveils Don Jazzy as Brand Ambassador:\r\nLoya milk, from the stable of Promasidor Nigeria limited has officially unveiled Don Jazzy as its new brand ambassador at a breathtaking event which took place on Friday in Lagos. Don Jazzy, who was palpably excited about the appointment eulogised Loya milk for the honour and pledged to play his new role creditably.', 80, 265, '2012-12-02 23:37:50', 'Show');
