INSERT INTO `post` VALUES(1082, 'Popular Lagos socialite and mens clothier, Benny Obaze, who owns Bevista and Revista, has remarried.\r\n \r\nBenny who has been single for many years, remarried over the weekend in a classy traditional wedding that held in Port Harcourt on Saturday December 1st. Benny married Lizzy Pirinye Finecountry, a successful businesswoman who operates two major businesses in Port Harcourt. She owns Serenissimo luxury Furniture Showroom, and Linnef Event Rentals and Events Management. Wishing them a happy married life!', 80, 265, '2012-12-03 23:21:19', 'Show');
