INSERT INTO `post` VALUES(1085, 'Chris and Rihanna Spending New Year in Barbados:\r\nAccording to The Sun, Chris Brown will be spending the New Year holiday in Barbados with Rihanna...\r\nThe more the public criticise Rihanna for getting back with Chris, the more determined she is to do whatever she wants. While no one else can understand it, shes convinced that Chris is the love of her life and her soulmate and that theyre simply meant to be together.', 80, 265, '2012-12-04 00:58:15', 'Show');
INSERT INTO `post` VALUES(1086, 'Philippines hit by Typhoon Bopha:\r\nMore than 40,000 people have been moved into shelter as a powerful typhoon hits the southern Philippines.\r\n\r\nTyphoon Bopha made landfall on Mindanao early on Tuesday, bringing heavy rain and wind gusts of 210 km/h (130mph).\r\n\r\nThe storm has caused widespread power cuts, travel disruption and flooding in areas at risk of landslides.\r\n\r\nThere were no immediate reports of casualties. Bopha comes a year after Typhoon Washi killed more than 1,500 people in the southern Philippines.', 80, 265, '2012-12-04 00:59:54', 'Show');
INSERT INTO `post` VALUES(1087, '10 killed in Bauchi attack:\r\nTEN persons were killed  and eight others injured on Sunday night following a gunfight between security operatives and suspected armed robbers in Azare town in Katagum  Local Government of Bauchi State.\r\n\r\nThe gunmen, numbering about 10, were said to have attacked a seed market in the town before some youths  and security operatives confonted them.\r\n\r\nA few hours after the incident,  a thief catcher, Ali Kwara,  arrested five persons for armed robbery.', 80, 265, '2012-12-04 01:02:24', 'Show');
INSERT INTO `post` VALUES(1088, 'Borrowing rises astronomically under Jonathan:\r\nUnder President Goodluck Jonathan, the Federal Government has borrowed a total of N2.57tn.\r\n\r\nThus, the Federal Governments debt profile rose from N4.18tn as of June 30, 2010 to N6.75tn as of June 30, 2012.\r\n\r\nJonathan was sworn in as Nigerias Acting President on February 10, 2010 following the death of President Umaru YarAdua and was later sworn in as the elected president on May 29, 2011.', 80, 265, '2012-12-04 01:04:03', 'Show');
