INSERT INTO `post` VALUES(1094, 'Former Actors'' Guild President, Segun Arinze, has confirmed the passing away of veteran actor, Enebeli Elebuwa in a hospital in India.\r\n\r\nMr Elebuwa died in the early hours of today Wednesday December 5th in the hospital in India where he was flown to a few months ago by the Delta State government to receive treatment for an ailment. He was 65. Truly sad! May his soul rest in peace. Amen.', 80, 265, '2012-12-05 07:24:49', 'Show');
INSERT INTO `post` VALUES(1095, 'Iyanya breaks Yvonne Nelson''s heart, dumps her for Tonto Dikeh:\r\nThis is not rumor o. Its fact! Iyanya''s four months relationship with Ghanaian actress Yvonne Nelson has ended. The two went their separate ways after Yvonne found out Iyanya was also involved with another actress, Tonto Dikeh. The relationship between Iyanya and Yvonne started in July this year and ended about a week ago. The one with Tonto, well, Iyanya and Tonto have been friends for a while, but they started getting real close in the last couple of weeks...\r\n\r\nYvonne has been venting on Twitter all morning...', 80, 265, '2012-12-05 07:28:42', 'Show');
INSERT INTO `post` VALUES(1096, 'CAF announces top three for African Player of the Year:\r\nThe confederation of African Football announces the top three candidates for this years African player of the year.\r\n\r\nReigning footballer of the year, Ivory coast and Manchester city Midfielder Yaya Toure is joined by fellow Ivorian and national team Captain, Didier Drogba and The Cameroonian midfielder Alexander song.\r\n\r\nThe winner will be announced later this month on 20th December at the Awards Gala in Accra, Gha', 80, 265, '2012-12-05 22:43:31', 'Show');
INSERT INTO `post` VALUES(1097, 'Oscar Niemeyer, Brazilian architect, dies at 104:\r\nHe rose to international fame as the architect of the main government buildings in the futuristic Brazilian capital, Brasilia, inaugurated in 1960. \r\n\r\nHe also worked with Swiss-born modernist architect Le Corbusier on the UN building in New York. \r\n\r\nHe continued to work on new projects until earlier this year. \r\n\r\nHe died on Wednesday at a hospital in Rio de Janeiro.\r\n\r\nA memorial service will be held in the presidential palace in Brasilia on Thursday. \r\n\r\nNiemeyer''s family was informed of the honour in a phone call from President Dilma Rousseff. \r\n\r\n', 80, 265, '2012-12-05 22:54:09', 'Show');
INSERT INTO `post` VALUES(1098, 'Olympic drug tests: Four athletes stripped of 2004 Athens medals\r\n\r\nFour athletes from the 2004 Athens Olympics have been stripped of their medals for using anabolic steroids. \r\n\r\nUkraine''s Yuriy Bilonog, Ivan Tsikhan and Irina Yatchenko of Belarus, and Russia''s Svetlana Krivelyova have all been ordered to hand back their medals. \r\n\r\nThe International Olympic Committee reanalysed several samples in a bid to catch those to had avoided detection. \r\n\r\nThe IOC put off a final decision on stripping Lance Armstrong of his 2000 Sydney Olympics bronze medal.', 80, 265, '2012-12-05 22:57:33', 'Show');
INSERT INTO `post` VALUES(1099, 'Champions League: Lionel Messi injured in Barca-Benfica draw\r\n\r\nLionel Messi missed out on a chance to match Gerd Mueller''s record of 85 goals in a calendar year as he was injured during Barcelona''s draw with Benfica. \r\n\r\nMessi, who hurt his left knee in a collision with Benfica keeper Artur, was taken off 30 minutes after coming on as a second-half substitute. \r\n\r\nBenfica knew a win would see them finish second behind Barca in Group G.', 80, 265, '2012-12-05 22:58:19', 'Show');
INSERT INTO `post` VALUES(1100, 'Manchester United suffered their first home defeat in the Champions League for three years on a night of frustration for manager Sir Alex Ferguson. \r\n\r\nIt is the first time United have failed to score at Old Trafford since being held by Rangers in September 2010. \r\n\r\nLuis Alberto''s goal early in the second half proved the difference, the Spaniard beating United goalkeeper David de Gea with a 25-yard strike. \r\n\r\nUnited had already qualified for the last 16 as winners of Group H.', 80, 265, '2012-12-05 22:59:05', 'Show');
