INSERT INTO `post` VALUES(1110, 'Jonathans foreign trips gulp N3.3bn travelled 20 times in 2012:\r\nBillions of naira of taxpayers money have been expended on the foreign trips of President Goodluck Jonathan despite his January promise to cut down on such trips.\r\n\r\nThis newspapers findings show that the President and his entourage have spent not less than N3.354bn on foreign trips since 2010.\r\n\r\nOur correspondent learnt that in the first 11 months of 2012, the President had travelled out of the country at least 20 times, including his trip to Sierra Leone in October and the D8 Summit he attended in Pakistan in November.(PUNCH)', 80, 265, '2012-12-06 23:40:33', 'Show');
