INSERT INTO `post` VALUES(1120, 'London-bound suspects caught with 175 wraps of cocaine:\r\nTwo suspects, Ugochukwu Nwafor and Chidozie Okonkwo were recently arrested by law enforcement agents at the Murtala Muhammed International Airport in Lagos for attempting to smuggle 2.880 kg of a substance believed to be cocaine out of the country.\r\n\r\nDuring the outward screening of the passengers on a British Airways flight to London, Nwafor and Okonkwo were found to have ingested 175 wraps of the hard drug.  \r\n\r\nConfirming the arrest, the commander of the National Drug Law Emnforcement Agency at the MMI airport, Mr. Hamza Umar, said the suspects were caught after a positive signal was triggered by the scanning machines.\r\n\r\nThe suspects tested positive to drug ingestion and were placed under observation. Nwafor ingested 73 wraps of cocaine weighing 1.395kg while Okonkwo ingested 102 wraps weighing 1.485kg. They were detected on the same flight, Hamza said.(PUNCH)', 80, 265, '2012-12-07 23:27:50', 'Show');
INSERT INTO `post` VALUES(1121, 'Bus driver, conductor squeal on suspected robbers:\r\nFour months after the murder of a post-graduate student of Nassarawa State University, Cynthia Osokogu by four men, five suspects have been arrested in Lagos for drugging and robbing commercial bus passengers at various points in the metropolis.\r\n\r\nThe suspects, Chibuike Mbakwe, Tochukwu Eze, Ifeanyi Okeke, Chidi Eze and Okechukwu Mbakwe are said to be members of a syndicate that specialises in robbing unsuspecting passengers in commercial buses by offering them sachet water laced with sedatives.(PUNCH)', 80, 265, '2012-12-07 23:29:04', 'Show');
