INSERT INTO `post` VALUES(1123, 'Tamara Ecclestone in 170,000 Rolls Royce:\r\nFresh off her flight from New York, Tamara Ecclestone was picked up in a flashy white Rolls Royce last Wednesday morning. The 28-year-old had only just landed at LAX but was already being treated to the good life as soon as she got off the plane.\r\n\r\nTamara was picked up from the airport in a flashy white Rolls Royce Ghost that was likely owned by her sister Petra. The top motor, which costs around 170,000, was bought for Petra, 23, as a wedding gift from her husband James Stunt.', 80, 265, '2012-12-09 02:01:37', 'Show');
INSERT INTO `post` VALUES(1124, 'Egypt crisis: President Morsi annuls decree\nEgyptian President Mohammed Morsi has annulled a decree he issued last month that hugely expanded his powers and sparked angry protests, officials say.\n\nHowever, a news conference in Cairo was told that a controversial referendum on a draft constitution would still go ahead as planned on 15 December.\n\nMr Morsi''s critics have accused him of acting like a dictator, but he says he is safeguarding the revolution.\n\nSome opposition figures were quick to dismiss his latest move.\n\nMr Morsi''s decree of 22 November', 80, 265, '2012-12-09 02:42:06', 'Show');
