INSERT INTO `post` VALUES(1140, 'Lagos Chief Judge frees 46 prisoners from Ikoyi Prisons:\nThe Chief Judge of Lagos State, Justice Ayotunde Phillips, yesterday Tuesday December 11th released 46 prisoners, including 75-year-old man, from the Ikoyi Prisons in Lagos during her visit to the prison.\n\nJustice Ayotunde Phillips released 233 prisoners just four months ago after reviewing their cases during a visit to the prison in September. She said the gesture was aimed at de-congesting the prison in order to alleviate the sufferings of the inmates.', 80, 265, '2012-12-11 22:20:27', 'Show');
