INSERT INTO `post` VALUES(1167, 'Man Stabs 22 Children At Chinese Elementary School:\r\nMan Stabs 22 Children At Chinese Elementary School\r\n\r\nA man stabbed 22 primary school students in a knife attack in China on Friday, officials said, the latest in a series of assaults. The attacker has been detained, said a spokesman for the Guangshan county government in the central province of Henan, where the stabbing happened.', 80, 265, '2012-12-14 22:47:19', 'Show');
INSERT INTO `post` VALUES(1168, 'Connecticut school shooting: Children among 27 killed:\r\nA gunman has killed 20 children and six adults at a primary school in the US state of Connecticut, police say. \r\n\r\nThe gunman, who also died, has not been formally identified by police. \r\n\r\nBut officials told US media that the killer at Sandy Hook Elementary School, in Newtown, was a 20-year-old son of a teacher. He is thought to have killed her before the attack.\r\n\r\nIt is one of the worst-ever US school shootings, with a toll close to the 32 who died at Virginia Tech in 2007.', 80, 265, '2012-12-14 22:49:34', 'Show');
INSERT INTO `post` VALUES(1169, 'FIRE DISASTER IN LAGOS:\r\nIt was a sad experience yesterday as a residential building at No 16 olatunji street ojota was engulfed in fire yesterday at about 6 P.M. The fire was said to have started from the kitchen,although the source of the fire has not been confirmed.No life lost but properties were totally destroyed.', 80, 265, '2012-12-14 22:58:19', 'Show');
INSERT INTO `post` VALUES(1170, 'Kaduna Governor, Gen Azazi, others feared dead in helicopter crash:\r\nA military helicopter carrying Kaduna State governor, Patrick Yakowa and the immediate past National Security Adviser, General Owoeye Azazi plus four others crashed this afternoon in the creeks of Bayelsa State.\r\n\r\nYakowa, Azazi and several other politicians attended the burial of the father of the Special Adviser to President Jonathan, Oronto Douglas in Bayelsa this afternoon and several helicopters were hired to transport the dignitaries to and from the event. \r\n\r\nThe helicopter conveying Yakowa, Azazi and others is believed to have crashed between 4:30/5:00 this evening around swampy Okoroba Community at Nembe local government Area of Bayelsa state.Nigeria''s National Emergency Management Authority say they are still looking for the helicopter.', 80, 265, '2012-12-15 11:17:38', 'Show');
INSERT INTO `post` VALUES(1171, 'Azazi, Yakowa, others perish in crash:\r\nIt was a harvest of tragedy on Saturday as Governor Patrick Yakowa of Kaduna State, the immediate national security adviser, Gen. Owoye Azazi, and four others were killed in a military helicopter crash at Okoroba Village in Ogbia Local Government Area of Bayelsa State.\r\n\r\nOthers involved in the accident were Yakowas Special Adviser, Dauda Tsoho; Azazis bodyguard, Warrant Officer Mohammed Kamal and two Naval pilots, Commander Murtala Mohammed Daba and Lt. Adeyemi Sowole.', 80, 265, '2012-12-15 22:41:21', 'Show');
INSERT INTO `post` VALUES(1172, 'Timi Dakolo and wife escape Bayelsa helicopter crash:\r\n2007 West African Idol winner Timi Dakolo and his wife Busola have a lot to be thankful for. It has emerged that the couple who attended Oronto Douglas'' father''s burial in Bayelsa today, were meant to fly on the same military chopper that claimed the lives of Governor Yakowa, Gen Azazi and others, but Timi decided at the very last minute to travel by road and not fly.', 80, 265, '2012-12-15 22:43:00', 'Show');
INSERT INTO `post` VALUES(1173, '16 yr-old cable vandal survives electrocution:\r\nA 16-year-old boy, Terseer Iorparegh, was caught stuck in a high tension cable while attempting to vandalize the PHCN cable along Naka road in Makurdi.\r\n\r\nVanguard gathered from the Senior Special Assistant to Governor Gabriel Suswam on Public Utilities, Mr. Gaddafi Asemanya who was at the scene said residents of the area were woken up by shout of help from the young man around 2.am on Thursday only to behold the teenager hanging between the high tension cable after he had suffered shock and first degree burns.\r\n\r\n\r\nAsemanya said the teenager who had removed the lower cable climbed the PHCN pole to vandalize the upper cable when his leg touched a line which caused a spark and fire which spread over his body while he persistently shouted for help.\r\n\r\nAccording to the governors aide, vandalism of PHCN property has become a serious issue in Benue State, in the last one year. I have apprehended over 30 vandals, while some were prosecuted many of these persons were set free because PHCH has no legal team to ensure the prosecution of these suspects, he said.\r\n\r\nHe explained that the residents had wanted to lynch the vandal but for his quick intervention and assistance by men of the fire service, the police and officers and men of the civil defence corps who were on hand to assist recover the vandal.\r\n\r\nThe Special Assitant further disclosed that the suspect was receiving medical attention at the Federal Medical Centre, Makurdi where he lied critically ill with no one coming to identify him.(VANGUARD)', 80, 265, '2012-12-15 22:44:44', 'Show');
INSERT INTO `post` VALUES(1174, 'Japanese vote in general election:\r\nPeople in Japan are voting in a general election in Japan, where former leader Shinzo Abe is challenging the current Prime Minister, Yoshihiko Noda.\r\nMr Abe''s Liberal Democratic Party (LDP) is expected to oust Mr Noda''s Democratic Party (DPJ) after just three years in office.\r\nMr Abe promises more public spending and a more assertive foreign policy as tensions with China run high.\r\nMany voters remain undecided, amid disillusionment in Japan over politics.\r\nMr Abe''s centre-right LDP was swept from office by the DPJ in 2009, ending more than 50 years of almost unbroken rule.', 80, 265, '2012-12-15 22:48:52', 'Show');
INSERT INTO `post` VALUES(1175, 'Manchester City''s Aleksandar Kolarov accused of racial abuse\r\n\r\nPolice are investigating an allegation that Manchester City player Aleksandar Kolarov racially abused Newcastle United supporters during his side''s game at St James'' Park. \r\n\r\nNorthumbria Police confirmed they were investigating a complaint following Saturday''s match. \r\n\r\nIt is alleged Serbia international defender Kolarov, 27, made comments to fans holding an Albanian flag. \r\n\r\nThere is a history of enmity between Serbia and Albania. \r\n\r\nThe force said it took such allegations ', 80, 265, '2012-12-15 22:51:03', 'Show');
INSERT INTO `post` VALUES(1176, 'Actress Nkiru Sylvanus kidnapped in Imo state yesterday morning:\r\nGot word this morning from friends of popular actress and Imo State SA on public affairs, Ms Nkiru Sylvanus, that she was kidnapped in owerri yesterday morning. Nkiru was last seen on the set of a movie last night in Owerri. The kidnappers took her early this morning and have already made contact with her family. They are asking for N100million.', 80, 265, '2012-12-16 23:08:04', 'Show');
INSERT INTO `post` VALUES(1177, 'Rihanna Blacks Out Because Of Chris Brown\n\nNothing like some good ole toxic love, eh? Recently news broke about Chris Brown dirty dog dippin in a French reality star while juggling Rihanna and Karreuche in Paris. \n\nAnd if that werent enough to set off the Bajan banger, Karates friend Christine Millian went on the Wendy Williams show and claimed she was still boo-d up with Breezy. \n\nSo what does a bad girl do when she feels like shes been wronged? Po it up', 80, 265, '2012-12-16 23:10:55', 'Show');
INSERT INTO `post` VALUES(1178, 'Usain Bolt wins BBC Overseas Sports Personality of the Year:\r\nSprinter Usain Bolt has been named the BBC Overseas Sports Personality of the Year after winning triple Olympic gold for the second successive Games. \r\n\r\n The 26-year-old Jamaican starred at the London 2012 Games as he claimed 100m, 200m and 4x100m titles.\r\nBolt became the only man to have retained both individual sprint golds and helped his team become the first to run under 37 seconds in the relay. \r\n\r\n His sixth Games gold made him the most decorated Olympic sprinter of all-time. \r\n\r\n It is the third time in the past five years he has been given the BBC honour.', 80, 265, '2012-12-16 23:12:25', 'Show');
