INSERT INTO `post` VALUES(1180, 'Police disqualify SSCE, Third Class holders from recruitment:\r\nPolice Service Commission says holders of Secondary School Certificate would no longer be accepted into the Nigeria Police Force as constables.\r\n\r\nIt said the minimum entry requirement now was Ordinary National Diploma.\r\n\r\nThe commission also stated that Third Class degree holders were no longer accepted as Cadet Inspectors, in line with the reform in the force.\r\n\r\nPSC Commissioner and Chairman, Public Affairs Committee of the commission, Ms. Comfort Obi, who stated this at a news conference in Abuja on Monday, explained that the commission had reviewed the recruitment process into the police.', 80, 265, '2012-12-18 02:24:24', 'Show');
INSERT INTO `post` VALUES(1181, 'Wizkid promises fans a concert like never before:\r\nInternational pop star Wizkid says his teeming fans are in for the big thrill this Friday, as he performs in Lagos with his label mates.\r\n\r\nThe EME concert, tagged The Baddest, is produced by events company R28, and is the first in a set of big-budget international standard concerts to be promoted by R28 and EME. The concert holds at The Grounds, Oceanview, in Victoria Island, Lagos, on Friday December 21.\r\n\r\n\r\nHeadlining this concert with my boss Banky W, and my colleagues Niyola, Shaydee, Skales, DJ Exclusive and others is truly a great way to end this fantastic year, says Wizzy who had earlier in the year toured the UK and US with his crew.\r\n\r\nAnd, trust me, were bringing a concert like never before.', 80, 265, '2012-12-18 02:26:17', 'Show');
