INSERT INTO `post` VALUES(1183, 'Nick Cannon Finally Explains Why He Had To Kick Kimmy Cakes To The Curb:\r\nNick Cannon Explains Why He Dumped Kim Kardashian\r\n\r\nNick Cannon revealed some secrets from his Hollywood playboy days during Tuesday mornings Howard Stern Show interview.\r\n\r\nCannon was dating soon-to-be reality star Kim Kardashian when her infamous, freaky tape with Ray J hit the internet. Cannon says he didnt break up with Kardashian because of the tape, but rather because she lied about it.', 80, 265, '2012-12-18 02:34:31', 'Show');
