INSERT INTO `post` VALUES(1186, 'Villagers flee as Lagos pipeline fire rages:\r\nRESIDENTS of Ijeododo in Ijegun, Lagos have fled the community following a pipeline explosion and the inferno in the village, located in Ojo Local Government of the state.\r\n\r\nThe Nigerian National Petroleum Corporation pipeline exploded on Monday night  in the community.\r\n\r\n As at 9.15pm on Tuesday, no casualty had been reported in the explosion said to have been caused by suspected pipeline vandals.\r\n\r\nOur correspondent gathered the incident might worsen the fuel scarcity in the South-West as the pipeline transports petrol pumped from Atlas Cove.\r\n\r\n The NNPC, it was learnt, had discontinued supply of petrol through the line following the explosion. The corporation pumps about 11 million litres of petrol per day through the pipeline.', 80, 265, '2012-12-18 23:34:53', 'Show');
INSERT INTO `post` VALUES(1187, 'Get a peek at rihrih''s new $12-million mansion in La La land:\r\nRihanna''s moving on after her leaky Beverly Hills home disaster last year-plunking down $12 million on a brand new mansion in the Pacific Palisades......just a few miles away.\r\nThe 11,000 sq.ft. house featuers 7 bedrooms,9 bathrooms,a cutting edge kitchen,a dining room with a 14-foot ceiling,an outdoor BBQ and bar,a swimming pool,a sun deck,4-car garage and a 6,000 sq.ft. backyard.\r\nRihanna might not have a man but she''s got a MAN-SION!', 80, 265, '2012-12-18 23:54:07', 'Show');
