INSERT INTO `post` VALUES(1193, 'Yaya Toure wins African Footballer of the Year 2012:\r\nIvorian midfielder Yaya Toure has been voted African Player of the Year for the second time running. The 29 year old Man City player, who aslo won it last year, was crowned yesterday evening at a glamorous Glo-CAF Awards Gala that held at the Banquet Hall, State House in Accra, Ghana. Well deserved?', 80, 265, '2012-12-20 23:15:02', 'Show');
