INSERT INTO `post` VALUES(1196, 'Champions League: Man Utd-Real Madrid relished by Alex Ferguson\r\nSir Alex Ferguson believes Manchester United''s clash with Real Madrid in the last 16 of the Champions League is the tie of the round. \r\nThe giants have not met since the 2003 quarter-finals of the Champions League, when Real Madrid won 6-5 on aggregate. \r\nChristiano Ronaldo will return to Old Trafford for the first time since his 80m move to the Bernabeu in June 2009.', 80, 265, '2012-12-20 23:22:20', 'Show');
INSERT INTO `post` VALUES(1197, 'Lionel Messi trails in third in Argentina sports awards:\r\nBarcelona goal machine Lionel Messi has come third behind a boxer and taekwondo fighter in a poll to find Argentina''s best sports star of 2012. \r\nMessi has scored a record 90 goals in 2012, including 12 for Argentina. \r\nHowever, Argentine journalists awarded the title to WBC middleweight champion Sergio Martinez, ahead of Sebastian Crismanich, who won the nation''s solitary Olympic gold at London 2012. \r\nMessi was voted the best Argentine footballer playing outside Argentina. \r\nMartinez won the title after defeating Mexico''s Julio Cesar Chavez Jr on points in September to win the world middleweight crown. \r\nThe 37-year-old will defend his title against Britain''s Martin Murray, 30, in Buenos Aires on 27 April.(BBC SPORT)', 80, 265, '2012-12-20 23:24:01', 'Show');
