INSERT INTO `post` VALUES(1202, 'Nigeria now import diesel and gas from Niger Republic:\r\nKano Controller, Department of Petroleum Product (DPR), Alhaji Sayyadi Suleiman Abubakar has revealed that Nigerian Marketers now import AGO and Liquefied Petroleum Gas(LPG) from neighboring OPEC member country, Niger Republic.\r\n\r\n Briefing reporters in his office on the activities of his department, Alhaji Sayyadi Suleiman Abubakar explained that the two products are in the exclusive list of deregulated items, adding that it could be acquired from anywhere and sold in the Nigerian market.', 80, 265, '2012-12-21 23:17:02', 'Show');
INSERT INTO `post` VALUES(1203, 'Adele beats out Rihanna, Gaga and Swift!:\r\nAdele tops Forbes list of Brightest Music Stars Under 30. The 24- year-old singer has sold over 23-million copies of her latest album, 21. Rihanna, One Direction, Bruno Mars, Taylor Swift, Justin Bieber, Lady Gaga and Ke$ha all also made the list. Head to Forbes.com for more details.', 80, 265, '2012-12-21 23:19:57', 'Show');
INSERT INTO `post` VALUES(1204, 'Fat Joe found guilty of tax evasion:\r\nActor Wesley Snipes might have a new cellmate now that rapper Fat Joe has also just been found guilty of tax evasion. According to Billboard, the rapper pled guilty to charges that he cheated the government out of roughly 700-thousand dollars in taxes in 2007 and 2008. Fat Joe is free on a 250-thousand dollar bond until his sentencing hearing in April, where he could face up to two years in prison.', 80, 265, '2012-12-21 23:21:21', 'Show');
