INSERT INTO `post` VALUES(1211, 'Xmas tragedy:LASTMA men beat bus driver to death:\r\nA commercial bus driver, Isaac Popoola, on Monday died after being allegedly assaulted by two officials of the Lagos State Traffic Management Authority in the Oshodi area of the state.\r\n\r\nThe bus conductor, Aremu Salawu, who witnessed the incident, said the LASTMA officials, Adesanya Olatunde and Oludele Ogunrinde, assaulted Popoola at about 6.30am around Brown Bus Stop resulting in his death.\r\n\r\nHe said the deceaseds bus with number plate, XL166SNK, conveying 17 passengers from Igando/Isheri was approaching Brown Junction when a LASTMA pick-up van crossed the bus.', 80, 265, '2012-12-24 22:40:34', 'Show');
INSERT INTO `post` VALUES(1212, 'Pilgrims celebrate birth of Jesus Christ in Bethlehem:\r\nThousands of Christian pilgrims from around the world are celebrating the birth of Jesus in Bethlehem. \r\n\r\nThe day culminated with Christmas Eve Mass at the 1,700-year-old Church of the Nativity, built on the spot where it is believed Jesus was born. \r\n\r\nIn Bethlehem, the head of the Roman Catholic Church in Jerusalem voiced his support for a Palestinian state.\r\n\r\nMeanwhile in the Vatican, Pope Benedict XVI held the traditional Mass at St Peter''s Basilica.\r\n\r\nThe pontiff urged Christians to ', 80, 265, '2012-12-24 22:43:21', 'Show');
