INSERT INTO `post` VALUES(1224, 'Nelson Mandela discharged from hospital:\r\nAfter almost three weeks in the hospital, former South African president, Nelson Mandela was discharged on Wednesday December 26th. The 94 year old was admitted to the hospital on Saturday December 8th to receive treatment for a lung infection and surgery to remove gallstones, which the doctors say was successful.', 80, 265, '2012-12-26 23:30:22', 'Show');
INSERT INTO `post` VALUES(1225, 'Governor Fashola vows to deal with owner of stored fire crackers:\r\nLagos state Governor, Babatunde Fashola, yesterday visited the site of the boxing day firecracker explosion that razed about 15 buildings and killed an 11 year old boy.  Fashola said he plans to punish the owner of the store on Oko Awo street where the fire crackers were stored. \r\n In order to make quick business, we have lost a life, we lost property and all of us are in danger. All of these items are under one form of prohibition or the other and we have men and women at our various entry and exit points. How did they get in? How did they enter? Who imported them and who cleared them? Who approved them to come in. Those are very serious issues we must also ask ourselves', 80, 265, '2012-12-26 23:31:37', 'Show');
