INSERT INTO `post` VALUES(1231, 'Fat Joe found guilty of tax evasion:\r\nActor Wesley Snipes might have a new cellmate now that rapper Fat Joe has also just been found guilty of tax evasion. According to Billboard, the rapper pled guilty to charges that he cheated the government out of roughly 700-thousand dollars in taxes in 2007 and 2008. Fat Joe is free on a 250-thousand dollar bond until his sentencing hearing in April, where he could face up to two years in prison.', 80, 265, '2012-12-27 21:46:42', 'Show');
INSERT INTO `post` VALUES(1232, 'Fire at Obasanjos Hilltop Mansion:\r\nBarely 24 hours after former President Olusegun Obasanjo celebrated the annual Ibogun Olaogun Day in his birthplace, Ibogun Olaogun, Ogun State, a section of his Hilltop mansion in Abeokuta was on Thursday gutted by fire.\r\n\r\nComputers and office appliances were among items said to have been destroyed in the inferno.', 80, 265, '2012-12-27 21:51:50', 'Show');
INSERT INTO `post` VALUES(1233, 'Manchester United send Bebe out on loan in Portugal:\r\nManchester United have sent 7.4m forward Bebe out on loan to Rio Ave. \r\n\r\nBebe joined from Portuguese club Guimaraes in 2010 and United boss Sir Alex Ferguson admitted he was the first player he had signed without watching. \r\n\r\n Having struggled to make an impact Bebe, 22, joined Turkish side Besiktas on a season-long loan in June 2011. \r\n\r\n He made just a handful of appearances for Besiktas before suffering a knee injury on Portugal Under-21 duty that sidelined him for most of last season.', 80, 265, '2012-12-27 21:53:08', 'Show');
INSERT INTO `post` VALUES(1234, 'Blackburn Rovers sack manager after 57 days:\r\nBlackburn Rovers have sacked manager Henning Berg after just 57 days in charge at Ewood Park. \r\n\r\n The 43-year-old former Rovers defender replaced Steve Kean on 31 October but the club have won just one of their 10 matches since his appointment. \r\n\r\n The Norwegian''s final game was a 1-0 defeat at Middlesbrough on Boxing Day, Blackburn''s fifth loss in six outings.', 80, 265, '2012-12-27 21:54:39', 'Show');
