INSERT INTO `post` VALUES(1253, 'FG to procure 10 million handsets worth N60billion for farmers:\r\nThe Federal Government is to spend about N60 billion to procure 10million telephone handsets from China and the US for free distribution to rural farmers across the country.\r\n\r\n The Permanent Secretary, Federal Ministry of Agriculture, Mrs Ibukun Odusote, said the handsets would be made available to the farmers in the first quarter of this year.\r\n\r\n She said the programme is aimed at establishing direct electronic communication between the government and farmers on agricultural matters, adding that the beneficiaries would be women and youths in rural areas.\r\n The handsets will be the tools with which to communicate with the farmers in the rural areas, deep deep into the interiors so that we will be able to communicate with them even in the hinterlands.\r\n Jeez, this country! N60billion to buy handsets? What are they buying, BlackBerry Porsche phones? Lol. And did the farmers say that their problem is a mobile phone? I don''t understand this our government...', 80, 265, '2013-01-04 02:01:34', 'Show');
INSERT INTO `post` VALUES(1254, 'Koreans paid N30m ransom for kidnapped expatriates  CP:\r\nKorean owners of the Hyndai Heavy Industries paid N30m to the kidnappers of four of their workers at the company in Okpoama, Brass Local Government, Bayelsa State, it has been confirmed.\r\n\r\nEight gunmen on December 17, 2012 raided the firm and kidnapped Jong Ken, Hi Kim, Doo Lee, Joon Chae and a Nigerian, Austin Giwa.\r\n\r\nThe victims were, however, released four days later at Azikoro Village in Yenagoa with the management of the company claiming that no ransom was paid for their release.\r\n\r\nHowever, our correspondent learnt that the company paid some money to secure the release of the victims, who spent about five days in the kidnappers den.(PUNCH)', 80, 265, '2013-01-04 02:36:52', 'Show');
INSERT INTO `post` VALUES(1255, 'Court disolves K-solo''s marriage, buys N7million SUV to celebrate:\r\nK-Solo''s brief marriage to the mother of his son, Kikelomo Oyeniyi, has finally been dissolved. A high court sitting in Ikeja dissolved the marriage on Thursday December 3rd, and to celebrate the divorce, the music producer bought himself a 2009 black Commander Jeep said to be worth N7m.\r\n\r\n K-Solo filed for divorce in June 2012 after only 8 months of marriage to Kikelomo who accused him of battery and produced photos of her bruised face to prove it.', 80, 265, '2013-01-06 01:07:41', 'Show');
INSERT INTO `post` VALUES(1256, 'Chris Brown moves in with Rihanna:\r\nChris Brown and Rihanna have decided to move in together. Chris Brown this week moved into Rihanna''s $12 million Pacific Palisades mansion which she bought right before Christmas', 80, 265, '2013-01-06 01:08:52', 'Show');
INSERT INTO `post` VALUES(1257, 'Confirmed! Obafemi Martins expecting a child with Abigail Barwuah :\r\nIt''s no longer a rumour. I just confirmed from Obafemi Martins'' people that he is indeed expecting a child with his girlfriend, Abigail Barwuah, who is footballer Mario Balotelli''s elder sister. The 24 year old who is currently in Nigeria with Obafemi is said to be about four months pregnant. Obafemi and Abigail only started dating in 2012.\r\n The child with Abigail will be Obafemi Martins'' third child. The never before married footballer already has two kids with two different women, one with an African chick he dated in Italy and a white chick he dated while playing in the UK. Will Obagoal marry his third baby mama? Let''s wait and see...', 80, 265, '2013-01-06 01:11:14', 'Show');
INSERT INTO `post` VALUES(1258, 'Tiwa Savage marries secretly?:\nNigerias talented, beautiful songwriter and singer, Tiwa, is not only humble and down to earth, the first lady of MAVINS record label, headed by Don Jazzy, also has a captivating aura and personality. Prior to the Elite Model Look Show which held in October, the ebony skinned diva hadnt been romantically linked with anyone. But on the said day, the singer and her tall, dark and handsome manager, Tunde Balogun, otherwise known as Tee Billz took many by surprise with a public display of affection. When asked on various occasions about the status of her relationship with her manager, the soft spoken Grammy nominee vehemently denied any romance between them. It was however gathered that the duo took time out to cement their relationship shortly before the end of 2012. Balogun wasnt willing to confirm their union. He said, It is just  a speculation', 80, 265, '2013-01-06 01:14:26', 'Show');
INSERT INTO `post` VALUES(1259, 'See Kim K''s baby bump:\r\nYou can see her baby bump poking through her tight blue dress.', 80, 265, '2013-01-07 21:48:02', 'Show');
INSERT INTO `post` VALUES(1260, 'Lionel Messi wins Ballon d''Or ahead of Ronaldo &amp; Iniesta:\r\nBarcelona and Argentina forward Lionel Messi has been awarded the Ballon d''Or for a fourth year running.\r\nMessi, 25, hit 91 goals during 2012 and beat club team-mate Andres Iniesta and Real Madrid''s Ronaldo to the trophy.Messi was announced as the winner of the Ballon d''Or, the award given to the world''s best player, during a ceremony held in Zurich on Monday.', 80, 265, '2013-01-07 21:52:33', 'Show');
INSERT INTO `post` VALUES(1261, 'Emmanuel Adebayor to represent Togo at Nations Cup 2013:\r\nTottenham forward Emmanuel Adebayor has reversed his decision not to represent Togo at January''s Africa Cup of Nations, leaving Spurs with Jermain Defoe as their only recognised striker.\r\nThe 28-year-old initially planned to remain with his club because of a row over team security and unpaid bonuses.', 80, 265, '2013-01-07 21:53:57', 'Show');
INSERT INTO `post` VALUES(1262, 'Fire guts INEC HQs voter registry:\r\nAN early morning fire on Monday ravaged the Voter Registry Department of the Independent National Electoral Commission, destroying some equipment.\r\n\r\nBut the electoral body has said that the fire would not have any negative impact on coming elections.\r\n\r\nThe fire outbreak has no effect on the oncoming elections as no data was affected, Director (Public Affairs) of the INEC, Mr. Emmanuel Umenger, told journalists in Abuja on Monday.', 80, 265, '2013-01-07 21:56:11', 'Show');
INSERT INTO `post` VALUES(1263, 'Sony unveils bath-friendly Xperia Z smartphone:\r\nSony has announced a new smartphone that can be used in the shower or bath without the risk of damage.\r\n\r\nThis water-resistant feature is relatively common in Japan, but has not been included in many top-end smartphones released elsewhere.\r\n\r\nThe Xperia Z can also record HDR (high dynamic range) video, a facility borrowed from its camera division.', 80, 265, '2013-01-07 21:58:06', 'Show');
INSERT INTO `post` VALUES(1264, 'ICE PRINCE, DAVID GUETTA COLLABO:\r\nIce Prince has reportedly collaborated with awarding winning DJ/producer, David Guetta on his new single. According to Nigerian Entertainment Today, the David Guetta-produced track will feature a seventeen year-old musician named Holly.', 80, 265, '2013-01-07 21:59:01', 'Show');
INSERT INTO `post` VALUES(1265, 'DAVIDO &amp; MANAGER SPLIT:\r\nDavido has parted ways with his manager, Asa Asika. It''s reported that the pair split over personal reasons. Asa has since edited his Twitter biography, deleting the bit that he manages Davido. Neither of the two have publicly addressed the matter so far.', 80, 265, '2013-01-07 21:59:54', 'Show');
