INSERT INTO `post` VALUES(1268, 'Forbes ranks Nigeria as the 20th saddest nation in the world:\r\nForbes has ranked Nigeria as the 20th saddest place to live in the whole world. Nigeria ranks 123rd overall on the Legatum Prosperity Index. Decades of corruption have squandered great oil and gas wealth, while new concerns involve sectarian violence.', 80, 265, '2013-01-11 00:14:44', 'Show');
