INSERT INTO `post` VALUES(1279, 'Arepo explosion: Bodies of vandals float on creeks:\r\nNNPC pipeline was vandalized on Saturday January 12th at Arepo in Ogun state, barely a month after it was fixed after it was vandalized in August 2012. The vandalism led to an explosion that killed several people.', 80, 265, '2013-01-14 23:04:13', 'Show');
INSERT INTO `post` VALUES(1280, 'Patience Jonathan flown out to Germany again?:\r\nSaharaReporters is reporting that our First Lady has been flown out to Germany on another emergency. They said medical sources in Abuja told them that the first Lady had to be flown out due to new health concerns.\r\n\r\nThere is no official word from the presidency regarding her trip and her principal media aide Ayo Osinlu told SaharaReporters by phone that he couldnt tell of Mrs Jonathan''s movements because he was not in Abuja at the moment.', 80, 265, '2013-01-14 23:07:01', 'Show');
