INSERT INTO `post` VALUES(1283, 'Men on motorbike and in a car yesterday afternoon attacked the convoy of the Emir of Kano, Ado Bayero, at Masalaci Murtala area of Kano. The Emir was returning from a ceremony at a mosque when the men opened fire on his convoy. The Emir survived the attack, but his driver and two guards were killed.', 80, 265, '2013-01-19 22:31:38', 'Show');
INSERT INTO `post` VALUES(1284, 'Dozens of bodies found floating on Anambra River:\r\nDozens of Unidentified bodies numbering over 40 were on Saturday found floating on Ezzu River at Amansea, a town on the border between Anambra and Enugu states on Saturday.\r\n\r\nThe situation generated panic across the state as people wondered where the bodies could have come from.\r\n\r\nThe Anambra State Assistant Police Public Relations Officer, Mr. Emeka Chukwuemeka, confirmed the story but said investigations into the matter had commenced. (Punch)', 80, 265, '2013-01-19 22:33:51', 'Show');
INSERT INTO `post` VALUES(1285, 'Bulgarian politician survives assasination attempt on Live TV:\r\nAhmed Dogan, leader of a liberal party which represents the Turkish minority in Bulgaria, survived the astonishing assassination attempt while giving a speech at a conference in the capital Sofia (left). Television footage shows a man storming the stage and aiming a gun at his head. But the weapon misfired and Mr Dogan, 58, escaped unharmed. Security guards and delegates then wrestle the man to the ground and began beating and kicking him. The 25-year-old suspect was led away covered in blood (right).', 80, 265, '2013-01-19 22:35:56', 'Show');
