INSERT INTO `post` VALUES(1287, 'Obama sworn in to second term:\r\nPresident Barack Obama, surrounded by family, took the oath of office yesterday Sunday January 20th in an intimate swearing-in ceremony at the White House. He was officially sworn-in by Chief Justice John Roberts in the Blue Room of the White House.', 80, 265, '2013-01-21 15:12:34', 'Show');
INSERT INTO `post` VALUES(1288, 'Emir of Kano, two sons flown to London for treatment after attack:\r\nThe Emir of Kano, and his two sons who were wounded during yesterday''s attack by unknown gunmen along the popular Zoo Road in Kano metropolis have been transported to a London hospital for medical attention.\r\n\r\nA private plane carrying them alongside some aides and relatives departed the Aminu Kano International Airport this afternoon.', 80, 265, '2013-01-21 15:15:22', 'Show');
