INSERT INTO `post` VALUES(1290, 'Dr Tunde Soleye confirms his marriage to Nike Oshinowo has ended:\r\nAfter six years of marital bliss, former beauty queen Nike Oshinowo has packed out of her matrimonial home. Dr Tunde Soleye confirmed it in an interview with Encomium magazine. He said:\r\n\r\n    We are no longer living together. Nike and I have sent out a joint statement on the issue. It is simple and clean. This is not a scandal. We had three options, the best of which is to tell the world the truth that we now live apart. We have been living apart for a couple of months now. We see occasionally. She calls me when she wants  and I speak with her too. There''s no fight. I have been to where she lives. We are still friends. We are going through a difficult time and we will come out of it.\r\n\r\nI know for sure that Nike Oshinowo moved out of Dr Soleye''s Lekki home mid last year and even when they stepped out together at Folorunsho Alakija''s thanksgiving party in September 2012, they were already living apart. Nike now lives in VI, while Dr Soleye has moved to Parkview Estate, Ikoyi.', 80, 265, '2013-01-22 04:46:17', 'Show');
INSERT INTO `post` VALUES(1291, 'Halima Abubakar Gets Honored as UN Ambassador:\r\nHalima Abubakar was one of the celebrities honoured with a UN ambassadorial award on Sunday January 20th. She''s an Ambassador for peace. Congrats to her.', 80, 265, '2013-01-22 04:47:52', 'Show');
