INSERT INTO `post` VALUES(1295, 'May D welcomes baby boy with girlfriend, Debola:\r\nThe singer''s longtime on/off girlfriend, Debola, gave birth to a baby boy today. Debola is the same chick that tattooed May D''s name on her arm and back. Congrats to them. See a photo of them together after the cut...', 80, 265, '2013-01-24 22:29:26', 'Show');
INSERT INTO `post` VALUES(1296, 'Catholic Church of Nigeria withdraws from the Christian Association of Nigeria:\r\nhe Catholic Church of Nigeria yesterday temporarily withdrew its membership from the Christian  Association of Nigeria (CAN). Their reason? That CAN under Pastor Ayo Oritsejafor has been compromised. Also because of some uncouth statements by some Christian leaders, and the use of money in CAN elections and several court cases involving state chapters of CAN.', 80, 265, '2013-01-24 22:30:20', 'Show');
INSERT INTO `post` VALUES(1297, 'Video chick, Honey Amber, flaunts baby bump...:\r\nHoney Amber is our own Amber Rose...and like Amber Rose who is her Idol, she''s also pregnant and flaunting her baby bump. I don''t know who the baby daddy is (heard its some guy in PH) but I hear she''s really looking forward to motherhood.\r\n\r\nThe 24 year old, whose real name is Honey J Willis, was the main girl in Brymo''s Ara video. She has also appeared in Sauce Kid''s Carolina, and Skuku''s Hallelujah videos.', 80, 265, '2013-01-24 22:31:24', 'Show');
INSERT INTO `post` VALUES(1298, 'Jim Ovia demolishes N600m property, turns it to temporary car park:\r\nBillionaire business man and former MD of Zenith Bank, Jim Ovia, has demolished the two-storey building standing on his Ozumba Mbadiwe property and has turned the land to a temporary car park for people who use his event place, Civic Centre. The car park and Civic centre share a fence.\r\n\r\nHeard they are planning to build a massive structure on the vacant plot later this year...maybe a hotel.', 80, 265, '2013-01-24 22:32:30', 'Show');
INSERT INTO `post` VALUES(1299, 'Mercy Johnson names daughter Purity Okojie:\r\nGot this exclusive gist from a very close friend of the actress. Mercy and her husband have named their daughter Purity Okojie. Purity was born on Sunday December 30th 2012. Mercy is due back in Nigeria next month February.\r\n\r\nMeanwhile, I heard that some movie producers have been sending movie scripts to the actress in the US. She''s been accepting them and plans to immediately hit a movie set once she returns to Nigeria.', 80, 265, '2013-01-24 22:33:40', 'Show');
INSERT INTO `post` VALUES(1300, 'Flower-eating goat has charges against it dropped in court:\r\nIt''s not only in Nigeria that they have some ode people o...lol...some of them can be found in Australia. Hehehe! According to Metro UK, a flower-eating goat named Gary has been cleared of vandalism after an Australian judge dismissed the case at a court in Sydney.\r\n\r\nHis owner Jim Dezarnaulds had been ordered to pay a 440 Australian dollar (290) fine after Gary was spotted snacking on a flower bed outside the citys Museum of Contemporary Art.\r\n\r\nThe case was dismissed however, after a judge ruled that neither Gary nor his owner could be held accountable for the crime.', 80, 265, '2013-01-24 22:34:25', 'Show');
