INSERT INTO `post` VALUES(1303, 'EFCC locates James Ibori''s abandoned house in Lekki:\r\nA spokesman man for the Economic and Financial Crimes Commission said yesterday that the agency on Thursday January 24th located a mansion belonging to the jailed former governor of Delta State, James Ibori. The property was discovered at 5, Alpha Beach Road, Lekki in Lagos.\r\n\r\nThe property, which the agency described as a mansion, has a mini reception, boys quarters and a swimming pool. \r\n\r\nThe anti-graft agency has for years been looking for and seizing properties belonging to James Ibori who was jailed in the UK last April for money laundering.', 80, 265, '2013-01-27 00:37:44', 'Show');
