INSERT INTO `post` VALUES(1306, 'Boko Haram leaders disagree over ceasefire:\r\nConfusion over the ceasefire declared by a faction of the fundamentalist Islamic sect, Jamaatul Ahjlil Sunna lidawati wal Jihad otherwise known as Boko Haram,  has persisted with  a   top  member of the group   dismissing any future dialogue with the Federal Government.\r\n\r\nMujhahedeen Marwana, who claims to be another   second-in-command to the  Boko Haram leader, Abubakar Shekau, predicated  his  position on the fact  that federal troops had  of  recent allegedly killed at least 47 Boko Haram  emissaries in  failed dialogue efforts.', 80, 265, '2013-01-30 23:22:39', 'Show');
