INSERT INTO `post` VALUES(1312, 'Worshippers give Bishop Oyedepo 700 cars as offering:\r\nThis actually happened a few weeks back but I''m only just hearing about it. According to sources in the know, during Winners Chapel Cross Over service on Tuesday January 1st in Canaanland, Ota, Ogun state, worshipers of the church made donations of over 700 exotic cars to the church. People who felt they had been richly blessed in 2012 came to the cross over service with different donations, most significant was the number of exotic brand new cars and SUVs that flooded Canaanland. The people who donated them dropped the keys and documents of the cars during offering. The church auctioned the cars at very cheap prizes to its members. Some cars were sold for as low as N300k.', 80, 265, '2013-01-31 22:09:26', 'Show');
INSERT INTO `post` VALUES(1313, 'Lynxxx launches his own mobile app:\r\nLynxxx has launched his very own Apple and Android mobile application named The Lynxxxtionary. The application offers direct chats with the musician, a music store, free music streaming, new exclusive music and an ebonics dictionary. It also features his music videos and an up to date show schedule calendar.\r\n\r\nIn other Lynxxx news, the ''Fine Lady'' hitmaker made the cover of the February issue of The Red Sheet Magazine. In the interview, he talks about his life and career.', 80, 265, '2013-01-31 22:15:24', 'Show');
INSERT INTO `post` VALUES(1314, 'HIJAB FOR A DAY;NON-MUSLIM WHO TRY THE HEADSCARF:\r\nWorld Hijab Day calls on non-Muslim women to try out life under the traditional head scarf. Can it lead to more religious tolerance and understanding?', 80, 265, '2013-01-31 22:25:56', 'Show');
INSERT INTO `post` VALUES(1315, 'Mexico City blast at Pemex, state oil giant, kills 14:\r\nAt least 14 people have died and another 100 were injured in Mexico City after an explosion at the headquarters of Mexico''s state oil company, Pemex.\r\n\r\nEmergency services, assisted by dogs, are searching for people trapped in the rubble. The cause of the blast is under investigation, Pemex says.\r\n\r\nThe 54-floor Pemex Executive Tower houses hundreds of employees.\r\n\r\nLast September, 30 people died in an explosion at a Pemex gas plant in northern Mexico.\r\n\r\nAt least 13 people were killed at the scene while another person died later in hospital, Mexican Interior Minister Miguel Angel Osorio Chong told reporters.\r\n\r\nA further 100 people were injured in the explosion. It is not clear how many individuals remain trapped beneath the rubble. Some reports have placed the figure at more than 30.(BBC)', 80, 265, '2013-01-31 22:28:13', 'Show');
INSERT INTO `post` VALUES(1316, 'Presidential spokesman Reuben Abati launches own news website:\r\nThe former chairman of the editorial board of the Guardian Newspaper and current Special Adviser on Media and Publicity to President Jonathan, now has his own website where he writes mostly about President Jonathan, President Jonathan and President Jonathan.A genuine source for everything President Jonathan. See for yourself - www.reubenabati.com.ng', 80, 265, '2013-02-03 00:34:56', 'Show');
INSERT INTO `post` VALUES(1317, 'Do you think Reverend King should die by hanging:\r\nA Court of Appeal sitting in Lagos yesterday ruled that Rev King, the General Overseer of the Christian Praying Assembly who was arrested and sentenced to death six years ago for murder, must die by hanging.\r\n\r\nReverend Chukwuemeka Ezeuko aka Rev King was arrested, prosecuted and sentenced to death by hanging in January 2007 for the death of one of his church members, a young girl named Ann Uzoh, who he set ablaze by pouring fuel on her along with 6 other church members after accusing them of committing fornication in his church. Ann died in hospital from injuries she sustained from the burn. Rev King has been in prison since then awaiting his death sentence, which he appealed and failed.\r\n\r\nWhat''s your thoughts on this? Think he deserves the death sentence', 80, 265, '2013-02-03 00:37:51', 'Show');
INSERT INTO `post` VALUES(1318, 'Flavour buys 2012 BMW X6?:\r\nhe talented high life musician got the BMW two weeks back. He already has a Mercedes Benz G-Wagon among other cars.\r\n\r\nFlavour is said to be one of the richest Nigerian music stars. He has been to 24 African countries to perform and charges about $50 thousands per show. Plus he has his hands in other businesses', 80, 265, '2013-02-03 00:40:02', 'Show');
