INSERT INTO `post` VALUES(1330, 'Majek Fashek chained at his home over deteriorating mental health:\r\nMajek Fashek is suffering from Schizophrenia according to the doctors taking care of him and his condition is getting really bad. Since he disappeared over the holidays and reappeared in January, he has been uncontrollable. People close to him said he overdid the drugs this time around and his mental illness has deteriorated seriously. People around his neighborhood in Gowon Estate Ipaja now avoid him like a plague. He walks around talking to himself and sometimes sits at a bus stop around his area playing his guitar while little kids make fun of him. To stop him from roaming around, and maybe hurting himself, sometimes people who care for him chain him at his Ipaja home, especially when he gets really out of control.\r\n\r\nSome people are saying it''s a spiritual problem. Whatever it is, hope he gets serious help before it''s too late. Such a sorry situation.', 80, 265, '2013-02-04 22:22:03', 'Show');
INSERT INTO `post` VALUES(1331, 'Happy birthday to Mavin First Lady - Tiwa Savage', 80, 265, '2013-02-04 22:23:26', 'Show');
INSERT INTO `post` VALUES(1332, 'Best pals Goldie and Denrele to star in their own TV reality show:\r\nGood friends, singer Goldie and TV personality Denrele Edun are set to star in their own TV reality show called - Goldie and Denrele: True Friendship\r\n\r\nThe show, which is being produced by Tee Jay Star, is about two friends in the volatile Naija entertainment industry, and how they support each other, have misunderstandings, their quiet moments, and their day to day struggles. They already shot some episodes.\r\n\r\nIt will start airing by the end of the month on Silverbird TV, TVC, BenTV UK.', 80, 265, '2013-02-04 22:25:38', 'Show');
INSERT INTO `post` VALUES(1333, 'Lagos court sentences 30 beggars to Kirikiri prison for begging alms:\r\nBeggars are now being locked up for begging alms in Lagos. Wow! About 30 of them were sentenced to Kirikiri Prison, some Badagry prison by the Special Offences Magistrate Court sitting in Alausa, Ikeja, yesterday Monday February 4th. \r\n\r\nThe Attorney General of Lagos State said the beggars committed an offence under the criminal law of the State. \r\n\r\nBegging alms in the streets of Lagos is illegal and the state environmental agency is doing all they can to get rid of as many beggars as they can. But is sending them to Kirikiri prison the answer? What do you guys think?', 80, 265, '2013-02-04 22:28:27', 'Show');
INSERT INTO `post` VALUES(1334, 'IYANYA / TIWA COLLAB:\r\nNigerian artist Iyanya recently released a new single called Somebody. The new single, which features the sexy Tiwa Savage, is off his forthcoming album Iyanya vs. Desire.\r\n\r\nThe Your Waist singer says that fans should expect to hear different sounds and genres of music on the new album.', 80, 265, '2013-02-04 22:30:20', 'Show');
INSERT INTO `post` VALUES(1335, 'Lewis Hamilton unveils 2013 Mercedes car:\r\nLewis Hamilton has unveiled the new Mercedes car that will carry his hopes in Formula 1 this season.\r\nThe 28-year-old, who has switched from McLaren, drove the car for a few laps at the Jerez circuit in Spain where pre-season testing begins on Tuesday.\r\nThe 2008 world champion said: ', 80, 265, '2013-02-04 22:32:17', 'Show');
