INSERT INTO `post` VALUES(1338, 'Sellers of pornographic materials arrested by Lagos state taskforce:\r\nThe Lagos State Taskforce on Environmental and Special Offences (Enforcement) Unit has begun clampdown on distributors and sellers of pornographic materials across Lagos, Southwest Nigeria.\r\n\r\nFour distributors of pornographic materials were arrested at Cele Bus Stop on Oshodi-Apapa Expressway on Tuesday by the taskforce after the police raided the area. Those arrested will be arraigned before the Special Offences Court at the taskforce yard and prosecuted for selling obscene materials.\r\n\r\nThe sellers of the materials arrested are Yinka Dada, 25 years; Udoh Nne, 29 years; Sylvester Obodoe, 18 years and Poopola Bamidele, 18 years.', 80, 265, '2013-02-07 01:49:17', 'Show');
INSERT INTO `post` VALUES(1339, 'Ailing Enugu state governor Sulivan Chime finally back in Nigeria:\r\nHeard he came in yesterday and is in Abuja at the moment. They say he will be in Enugu on Friday', 80, 265, '2013-02-07 01:50:55', 'Show');
